            migrationBuilder.InsertData(
                table: "SpellComponents",
                columns: new[] { "Id", "Description", "Name", "SpellsId" },
                values: new object[,]
                {
                    { new Guid("8665739e-a938-4927-afb6-be0c2d15fdc0"), "A somatic component is a specific hand movement or gesture that generates a magical nexus.The spell gains the manipulate trait and requires you to make gestures.You can use this component while holding something in your hand, but not if you are restrained or otherwise unable to gesture freely. Spells that require you to touch the target require a somatic component. You can do so while holding something as long as part of your hand is able to touch the target(even if it’s through a glove or gauntlet).", "Somatic", null },
                    { new Guid("4a9cf550-0cb7-4df1-8519-45765fc23af3"), "A material component is a bit of physical matter consumed in the casting of the spell. The spell gains the manipulate trait and requires you to have a free hand to retrieve and manipulate a material component. That component is expended in the casting (even if the spell is disrupted). Except in extreme circumstances, you can assume all common components are included in a material component pouch.", "Material", null },
                    { new Guid("dacdeaaa-2a0e-4cf8-b011-d896947fbf3f"), "A verbal component is a vocalization of words of power. You must speak them in a strong voice, so it’s hard to conceal that you’re Casting a Spell.The spell gains the concentrate trait.You must be able to speak to provide this component.", "Verbal", null },
                    { new Guid("1438bb9e-3ce3-4b33-93a5-1728b134b9ff"), "A focus is an object that funnels the magical energy of the spell. The spell gains the manipulate trait and requires you to either have a free hand to retrieve the focus listed in the spell or already be holding the focus in your hand. As part of Casting the Spell, you retrieve the focus (if necessary), manipulate it, and can put it away again if you so choose. Foci tend to be expensive, and you need to acquire them in advance to Cast the Spell.", "Focus", null }
                });

            migrationBuilder.InsertData(
                table: "SpellTypes",
                columns: new[] { "Id", "Description", "Name" },
                values: new object[,]
                {
                    { new Guid("daeadc1d-bf76-442b-9b4c-8276fa9effac"), "A regular spell that has to be prepared or can be cast spontaneously, without any additional focus requirements, using a spell slot in the process.", "Spell" },
                    { new Guid("fbd536e4-6468-4ca5-84de-aa2e5a33776f"), "A cantrip is a special type of spell that’s weaker than other spells but can be used with greater freedom and flexibility. The title of a cantrip’s stat block says “Cantrip” instead of “Spell.” Casting a cantrip doesn’t use up your spell slots; you can cast a cantrip at will, any number of times per day. If you’re a prepared caster, you can prepare a specific number of cantrips each day. You can’t prepare a cantrip in a spell slot. A cantrip is always automatically heightened to half your level, rounded up. For a typical spellcaster, this means its level is equal to the highest level of spell slot you have.", "Cantrip" },
                    { new Guid("69863985-2984-4514-9299-588c6dd32cd7"), "Focus spells are a special type of spell attained directly from a branch of study, from a deity, or from another specific source. You can learn focus spells only through special class features or feats, rather than choosing them from a spell list. Furthermore, you cast focus spells using a special pool of Focus Points—you can’t prepare a focus spell in a spell slot or use your spell slots to cast focus spells; similarly, you can’t spend your Focus Points to cast spells that aren’t focus spells. Even some classes that don’t normally grant spellcasting, such as the champion and monk, can grant focus spells. Focus spells are automatically heightened to half your level rounded up, just like cantrips are. You can’t cast a focus spell if its minimum level is greater than half your level rounded up, even if you somehow gain access to it. Casting any of your focus spells costs you 1 Focus Point. You automatically gain a focus pool of 1 Focus Point the first time you gain an ability that gives you a focus spell. You replenish all the Focus Points in your pool during your daily preparations. You can also use the Refocus activity to pray, study, meditate, or otherwise reattune yourself to the source of your focus magic and regain a Focus Point. Some abilities allow you to increase the Focus Points in your pool beyond 1. Typically, these are feats that give you a new focus spell and increase the number of points in your pool by 1. Your focus pool can’t have a capacity beyond 3 Focus Points, even if feats that increase your pool would cause it to exceed this number.", "Focus" }
                });

            migrationBuilder.InsertData(
                table: "Stats",
                columns: new[] { "Id", "Abbreviation", "Description", "KeyAbilityClassesId", "Name" },
                values: new object[,]
                {
                    { new Guid("e9e25044-7005-48c7-81bc-372c8a9f829a"), "WIS", "Wisdom measures your character’s common sense, awareness, and intuition. Your Wisdom modifier is added to your Perception and Will saving throws.", null, "Wisdom" },
                    { new Guid("f4206177-80d3-4c9c-8f79-357a608897fa"), "CHA", "Charisma measures your character’s personal magnetism and strength of personality. A high Charisma score helps you influence the thoughts and moods of others.", null, "Charisma" },
                    { new Guid("37406a59-0dd9-4766-8713-33b13b7740fd"), "INT", "Intelligence measures how well your character can learn and reason. A high Intelligence allows your character to analyze situations and understand patterns, and it means they can become trained in additional skills and might be able to master additional languages.", null, "Intellect" },
                    { new Guid("3e44bfc5-4aeb-4b46-9bdd-d4da39d40137"), "STR", "Strength measures your character’s physical power.  Strength is important if your character plans to engage in hand - to - hand combat.Your Strength modifier gets added to melee damage rolls and determines how much your character can carry.", null, "Strength" },
                    { new Guid("21b2cca1-66cd-48d1-a91b-085521659548"), "DEX", "Dexterity measures your character’s agility, balance, and reflexes. Dexterity is important if your character plans to make attacks with ranged weapons or use stealth to surprise foes. Your Dexterity modifier is also added to your character’s AC and Reflex saving throws.", null, "Dexterity" },
                    { new Guid("10e9f065-a160-47e5-97df-72df4ec5ea15"), "CON", "Constitution measures your character’s overall health and stamina. Constitution is an important statistic for all characters, especially those who fight in close combat.  Your Constitution modifier is added to your Hit Points and Fortitude saving throws.", null, "Constitution" }
                });

            migrationBuilder.InsertData(
                table: "Traits",
                columns: new[] { "Id", "ActionsId", "AlchemicalBombsId", "AlchemicalElixirsId", "AlchemicalPoisonsId", "AlchemicalToolsId", "CursesId", "Description", "DiseasesId", "FeatsId", "HazardActionEffectsId", "HazardActionsId", "HazardsId", "Name", "SpellsId" },
                values: new object[,]
                {
                    { new Guid("d052779d-0c7e-4fe0-915b-91d3e71fb517"), null, null, null, null, null, null, "Fungal creatures have the fungus trait. They are distinct from normal fungi.", null, null, null, null, null, "Fungus", null },
                    { new Guid("7684fa81-e3a5-4224-8d57-bc61df53d54a"), null, null, null, null, null, null, "Effects with this trait determine what is likely to happen in the near future. Most predictions are divinations.", null, null, null, null, null, "Prediction", null },
                    { new Guid("2bc07fcc-2113-4b39-a257-17851f1f216d"), null, null, null, null, null, null, "Vegetable creatures have the plant trait. They are distinct from normal plants. Magical effects with this trait manipulate or conjure plants or plant matter in some way. Those that manipulate plants have no effect in an area with no plants.", null, null, null, null, null, "Plant", null },
                    { new Guid("1a83b706-d9c1-4b46-bcf3-3c9bb82219ee"), null, null, null, null, null, null, "These effects transform the target into a new form. A target can’t be under the effect of more than one polymorph effect at a time. If it comes under the effect of a second polymorph effect, the second polymorph effect attempts to counteract the first. If it succeeds, it takes effect, and if it fails, the spell has no effect on that target. Any Strikes specifically granted by a polymorph effect are magical. Unless otherwise stated, polymorph spells don’t allow the target to take on the appearance of a specific individual creature, but rather just a generic creature of a general type or ancestry. If you take on a battle form with a polymorph spell, the special statistics can be adjusted only by circumstance bonuses, status bonuses, and penalties. Unless otherwise noted, the battle form prevents you from casting spells, speaking, and using most manipulate actions that require hands. (If there’s doubt about whether you can use an action, the GM decides.) Your gear is absorbed into you; the constant abilities of your gear still function, but you can’t activate any items.", null, null, null, null, null, "Polymorph", null },
                    { new Guid("33bf3198-48a1-4559-9a48-9881901f880b"), null, null, null, null, null, null, "Effects that slightly alter a creature’s form have the morph trait. Any Strikes specifically granted by a morph effect are magical. You can be affected by multiple morph spells at once, but if you morph the same body part more than once, the second morph effect attempts to counteract the first (in the same manner as two polymorph effects, described in that trait). Your morph effects might also end if you are polymorphed and the polymorph effect invalidates or overrides your morph effect. The GM determines which morph effects can be used together and which can’t.", null, null, null, null, null, "Morph", null },
                    { new Guid("2cbfa741-d7b5-465c-98b4-7a6bceae533e"), null, null, null, null, null, null, "A mental effect can alter the target’s mind. It has no effect on an object or a mindless creature.", null, null, null, null, null, "Mental", null },
                    { new Guid("315bf80d-594e-46ca-944e-cb8287df46fa"), null, null, null, null, null, null, "An effect with this trait depends on language comprehension. A linguistic effect that targets a creature works only if the target understands the language you are using.", null, null, null, null, null, "Linguistic", null },
                    { new Guid("06f2cf99-b089-4e34-b443-53028fdc2ae0"), null, null, null, null, null, null, "A healing effect restores a creature's body, typically by restoring Hit Points, but sometimes by removing diseases or other debilitating effects.", null, null, null, null, null, "Healing", null },
                    { new Guid("be9994ab-79ef-4ec0-9761-492059b0083a"), null, null, null, null, null, null, "An ability with this trait can take a character completely out of the fight or even kill them, and it’s harder to use on a more powerful character. If a spell has the incapacitation trait, any creature of more than twice the spell’s level treats the result of their check to prevent being incapacitated by the spell as one degree of success better, or the result of any check the spellcaster made to incapacitate them as one degree of success worse. If any other effect has the incapacitation trait, a creature of higher level than the item, creature, or hazard generating the effect gains the same benefits.", null, null, null, null, null, "Incapacitation", null },
                    { new Guid("fc3cb057-dcb6-4508-915a-0abd25679211"), null, null, null, null, null, null, "Evil effects often manipulate energy from evil-aligned Outer Planes and are antithetical to good divine servants or divine servants of good deities.", null, null, null, null, null, "Evil", null },
                    { new Guid("1ee8c64b-ad34-4b3b-a01c-a1057eea01f6"), null, null, null, null, null, null, "This effect alters a creature's emotions. Effects with this trait always have the mental trait as well. Creatures with special training or that have mechanical or artificial intelligence are immune to emotion effects.", null, null, null, null, null, "Emotion", null },
                    { new Guid("0cb3dbbc-941b-4e27-b46c-d0246dacc056"), null, null, null, null, null, null, "An effect with this trait applies one or more diseases. A disease is typically an affliction.", null, null, null, null, null, "Disease", null },
                    { new Guid("a23df7f5-acc6-4f87-9244-0fbbc77c70d2"), null, null, null, null, null, null, "Effects with this trait attempt to determine the presence or location of a person, object, or aura.", null, null, null, null, null, "Detection", null },
                    { new Guid("f1f5c47a-fec2-4983-8229-3c4e8b43f0b5"), null, null, null, null, null, null, "An effect with the death trait kills you immediately if it reduces you to 0 HP. Some death effects can bring you closer to death or slay you outright without reducing you to 0 HP.", null, null, null, null, null, "Death", null },
                    { new Guid("e5b98ff4-8503-461c-870d-7b8c8e4811fa"), null, null, null, null, null, null, "Chaotic effects often manipulate energy from chaos-aligned Outer Planes and are anathema to lawful divine servants or divine servants of lawful deities.", null, null, null, null, null, "Chaotic", null },
                    { new Guid("9da1e40e-f9b8-4381-9167-229fee66f4f7"), null, null, null, null, null, null, "A spell you can cast at will that is automatically heightened to half your level rounded up.", null, null, null, null, null, "Cantrip", null },
                    { new Guid("856db08f-edad-472b-b870-65a8f16252a5"), null, null, null, null, null, null, "An ability with this trait involves an attack. For each attack you make beyond the first on your turn, you take a multiple attack penalty.", null, null, null, null, null, "Attack", null },
                    { new Guid("5f7b92e7-09d2-4717-8588-56b45c08a111"), null, null, null, null, null, null, "The GM rolls the check for this ability in secret.", null, null, null, null, null, "Secret", null },
                    { new Guid("4f8453ab-e7f8-4d2f-95e7-e0e53a32cbde"), null, null, null, null, null, null, "Effects with this trait see things as they truly are.", null, null, null, null, null, "Revelation", null },
                    { new Guid("ad251fb5-0c53-47f9-b850-fcefd4cb3165"), null, null, null, null, null, null, "A hazard with this trait takes turns in an encounter.", null, null, null, null, null, "Complex", null },
                    { new Guid("f91abbe0-0bec-4278-99d0-b12f044f8061"), null, null, null, null, null, null, "A scrying effect lets you see, hear, or otherwise get sensory information from a distance using a sensor or apparatus, rather than your own eyes and ears.", null, null, null, null, null, "Scrying", null },
                    { new Guid("9979d44e-3a35-4eef-a767-d3c974b5fbf6"), null, null, null, null, null, null, "A fortune effect beneficially alters how you roll your dice. You can never have more than one fortune effect alter a single roll. If multiple fortune effects would apply, you have to pick which to use. If a fortune effect and a misfortune effect would apply to the same roll, the two cancel each other out, and you roll normally.", null, null, null, null, null, "Fortune", null },
                    { new Guid("b02d26f9-e334-4f2b-b713-767621853861"), null, null, null, null, null, null, "A hazard with this trait is something dangerous that’s part of the natural world, such as quicksand or harmful mold.", null, null, null, null, null, "Environmental", null },
                    { new Guid("9762a78e-698f-4bbb-81ec-fe1f0784f961"), null, null, null, null, null, null, "A hazard with this trait is a constructed physical object.", null, null, null, null, null, "Mechanical", null },
                    { new Guid("86fb6cb4-506a-43c8-99d6-152b9624594f"), null, null, null, null, null, null, "A hazard with this trait is a spiritual echo, often of someone with a tragic death. Putting a haunt to rest often involves resolving the haunt’s unfinished business. A haunt that hasn’t been properly put to rest always returns after a time.", null, null, null, null, null, "Haunt", null },
                    { new Guid("67f31585-bba4-4a97-8bfc-ab95013410d4"), null, null, null, null, null, null, "A hazard or item with this trait is constructed to hinder interlopers.", null, null, null, null, null, "Trap", null },
                    { new Guid("e3574cce-b028-4a4a-a2c7-fc3e0cfdd4ee"), null, null, null, null, null, null, "An elixir with the mutagen trait temporarily transmogrifies the subject’s body and alters its mind. A mutagen always conveys one or more beneficial effects paired with one or more detrimental effects. Mutagens are polymorph effects, meaning you can benefit from only one at a time.", null, null, null, null, null, "Mutagen", null },
                    { new Guid("69712c6e-b328-46e4-a38a-0dc302c469f7"), null, null, null, null, null, null, "Elixirs are alchemical liquids that are used by drinking them.", null, null, null, null, null, "Elixir", null },
                    { new Guid("7c5d73c4-d239-4cdf-ae95-e3f802156f6b"), null, null, null, null, null, null, "When you use a thrown weapon with the splash trait, you don’t add your Strength modifier to the damage roll. If an attack with a splash weapon fails, succeeds, or critically succeeds, all creatures within 5 feet of the target (including the target) take the listed splash damage. On a failure (but not a critical failure), the target of the attack still takes the splash damage. Add splash damage together with the initial damage against the target before applying the target’s weaknesses or resistances. You don’t multiply splash damage on a critical hit.", null, null, null, null, null, "Splash", null },
                    { new Guid("00c4abbe-bed2-4e1c-8ef2-826234212f4c"), null, null, null, null, null, null, "An item with this trait can be used only once. Unless stated otherwise, it's destroyed after activation. Consumable items include alchemical items and magical consumables such as scrolls and talismans. When a character creates consumable items, they can make them in batches of four.", null, null, null, null, null, "Consumable", null },
                    { new Guid("74d0e1f3-cbab-44df-b024-fdfebb5b27f3"), null, null, null, null, null, null, "An alchemical bomb combines volatile alchemical components that explode when the bomb hits a creature or object. Most alchemical bombs deal damage, though some produce other effects.", null, null, null, null, null, "Bomb", null },
                    { new Guid("897e454f-a75b-448d-a75b-8d6e0f681d11"), null, null, null, null, null, null, "Alchemical items are powered by reactions of alchemical reagents. Alchemical items aren’t magical and don’t radiate a magical aura.", null, null, null, null, null, "Alchemical", null },
                    { new Guid("7b601f4a-9c05-426c-aa46-14e8fa989066"), null, null, null, null, null, null, "Afflictions with the virulent trait are harder to remove. You must succeed at two consecutive saves to reduce a virulent affliction’s stage by 1. A critical success reduces a virulent affliction’s stage by only 1 instead of by 2.", null, null, null, null, null, "Virulent", null },
                    { new Guid("4b9d47d5-3e89-41ba-8183-9e743c49a41a"), null, null, null, null, null, null, "This effect can cause a creature to fall asleep or get drowsy.", null, null, null, null, null, "Sleep", null },
                    { new Guid("39aba859-33a5-45df-b1fe-902f8e3c2273"), null, null, null, null, null, null, "Something with the magical trait is imbued with magical energies not tied to a specific tradition of magic. A magical item radiates a magic aura infused with its dominant school of magic.  Some items or effects are closely tied to a particular tradition of magic. In these cases, the item has the arcane, divine, occult, or primal trait instead of the magical trait. Any of these traits indicate that the item is magical.", null, null, null, null, null, "Magical", null },
                    { new Guid("739ead1c-4020-4673-96d2-4d0b543f6295"), null, null, null, null, null, null, "A curse is an effect that places some long-term affliction on a creature. Curses are always magical and are typically the result of a spell or trap. Effects with this trait can be removed only by effects that specifically target curses.  Afflictions with this trait are manifestations of potent ill will.A curse either lasts a specified amount of time or can be removed only by certain actions a character must perform or conditions they must meet.A curse with stages follows the rules for afflictions. (Gamemastery Guide pg. 251)", null, null, null, null, null, "Curse", null },
                    { new Guid("f7ad867e-49e3-40e3-ad95-bbf461be2087"), null, null, null, null, null, null, "Fear effects evoke the emotion of fear. Effects with this trait always have the mental and emotion traits as well.", null, null, null, null, null, "Fear", null },
                    { new Guid("ccae1335-3555-4e55-9fe4-d22f6b9bc162"), null, null, null, null, null, null, "An activity with this trait takes a day or more, and can be used only during downtime", null, null, null, null, null, "Downtime", null },
                    { new Guid("dee6c869-337c-4f4c-ba3c-3c3e77c19857"), null, null, null, null, null, null, "You must physically manipulate an item or make gestures to use an action with this trait. Creatures without a suitable appendage can’t perform actions with this trait. Manipulate actions often trigger reactions.", null, null, null, null, null, "Manipulate", null },
                    { new Guid("c5e1a5e7-5d45-4826-b2ea-018b361770de"), null, null, null, null, null, null, "An action with this trait requires a degree of mental concentration and discipline.", null, null, null, null, null, "Concentrate", null },
                    { new Guid("340e83a5-5a6e-4a5f-8658-7aede58da5a9"), null, null, null, null, null, null, "Teleportation effects allow you to instantaneously move from one point in space to another. Teleportation does not usually trigger reactions based on movement.", null, null, null, null, null, "Teleportation", null },
                    { new Guid("08bac763-e881-4a70-b253-916191ee9713"), null, null, null, null, null, null, "An action with this trait involves moving from one space to another.", null, null, null, null, null, "Move", null },
                    { new Guid("3d4c67f6-d5a1-4529-9559-02aa18d81054"), null, null, null, null, null, null, "A type of feat that any character can select, regardless of ancestry and class, as long as they meet the prerequisites. You can select a feat with this trait when your class grants a general feat.", null, null, null, null, null, "General", null },
                    { new Guid("0c06a5b8-24e7-486b-bb98-91caef377013"), null, null, null, null, null, null, "Something of uncommon rarity requires special training or comes from a particular culture or part of the world. Some character choices give access to uncommon options, and the GM can choose to allow access for anyone. Less is known about uncommon creatures than common creatures. They typically can’t be summoned. The DC of Recall Knowledge checks related to these creature is increased by 2.", null, null, null, null, null, "Uncommon", null },
                    { new Guid("5b33384c-0c98-4238-8257-8b911933308e"), null, null, null, null, null, null, "Anything that doesn't list another rarity trait (uncommon, rare, or unique) automatically has the common trait. This rarity indicates that an ability, item, or spell is available to all players who meet the prerequisites for it. A creature of this rarity is generally known and can be summoned with the appropriate summon spell.", null, null, null, null, null, "Common", null },
                    { new Guid("3de4876d-2336-4d5e-bbbb-5b4e83ea6d49"), null, null, null, null, null, null, "This magic comes from the primal tradition, connecting to the natural world and instinct. Anything with this trait is magical.", null, null, null, null, null, "Primal", null },
                    { new Guid("0e3307ce-952d-4d93-bcac-95bbf495ee85"), null, null, null, null, null, null, "This magic comes from the occult tradition, calling upon bizarre and ephemeral mysteries. Anything with this trait is magical.", null, null, null, null, null, "Occult", null },
                    { new Guid("561c7c89-44d2-492e-b12f-352af45b6a6b"), null, null, null, null, null, null, "This magic comes from the divine tradition, drawing power from deities or similar sources. Anything with this trait is magical.", null, null, null, null, null, "Divine", null },
                    { new Guid("a0e52203-1c57-4a58-bff2-7e262b56181f"), null, null, null, null, null, null, "This magic comes from the arcane tradition, which is built on logic and rationality. Anything with this trait is magical.", null, null, null, null, null, "Arcane", null },
                    { new Guid("812b4b93-b467-438f-9561-ef020545755f"), null, null, null, null, null, null, "An effect with the sonic trait functions only if it makes sound, meaning it has no effect in an area of silence or in a vacuum. This is different from an auditory spell, which is effective only if the target can hear it. A sonic effect might deal sonic damage. A creature with this trait has a magical connection to powerful sound.", null, null, null, null, null, "Sonic", null },
                    { new Guid("ece55c2d-2715-4e67-aa1e-736c019e89a6"), null, null, null, null, null, null, "Effects with this trait heal living creatures with positive energy, deal positive energy damage to undead, or manipulate positive energy. Planes with this trait are awash with life energy of such intensity that it can harm living creatures. Creatures with this trait are natives of the Positive Energy Plane. They can survive the basic environmental effects of the Positive Energy Plane.", null, null, null, null, null, "Positive", null },
                    { new Guid("f2810f2b-6f8a-4fb1-b00f-a9d307f97eff"), null, null, null, null, null, null, "This rarity indicates that a rules element is very difficult to find in the game world. A rare feat, spell, item or the like is available to players only if the GM decides to include it in the game, typically through discovery during play. Creatures with this trait are rare. They typically can’t be summoned. The DC of Recall Knowledge checks related to these creatures is increased by 5.", null, null, null, null, null, "Rare", null },
                    { new Guid("30ed464b-6bf4-4a80-8c42-8bb95ecb751c"), null, null, null, null, null, null, "Effects with this trait heal undead creatures with negative energy, deal negative damage to living creatures, or manipulate negative energy. Planes with this trait are vast, empty reaches that suck the life from the living. Creatures with this trait are natives of the Negative Energy Plane. They can survive the basic environmental effects of the Negative Energy Plane.", null, null, null, null, null, "Negative", null },
                    { new Guid("dc6ca4d1-85f2-4be9-bc39-9a48b943b392"), null, null, null, null, null, null, "Effects with this trait deal electricity damage. A creature with this trait has a magical connection to electricity.", null, null, null, null, null, "Electricity", null },
                    { new Guid("36d65d85-b689-46da-86b6-4f0838f296e6"), null, null, null, null, null, null, "Effects with this trait deal cold damage. Creatures with this trait have a connection to magical cold.", null, null, null, null, null, "Cold", null },
                    { new Guid("44a15dce-b0cf-4d6a-a4be-92d759fdbaa3"), null, null, null, null, null, null, "Effects with this trait deal acid damage. Creatures with this trait have a magical connection to acid.", null, null, null, null, null, "Acid", null },
                    { new Guid("689bc25d-de13-418c-8da2-a9280936359d"), null, null, null, null, null, null, "Effects with the earth trait either manipulate or conjure earth. Those that manipulate earth have no effect in an area without earth. Creatures with this trait consist primarily of earth or have a magical connection to that element. Planes with this trait are mostly solid, with caverns and other hollow pockets.", null, null, null, null, null, "Earth", null },
                    { new Guid("d1aabc8c-b3fe-40eb-bfc2-ea72d3b7e0c0"), null, null, null, null, null, null, "Effects with the fire trait deal fire damage or either conjure or manipulate fire. Those that manipulate fire have no effect in an area without fire. Creatures with this trait consist primarily of fire or have a magical connection to that element. Planes with this trait are composed of flames that continually burn with no fuel source. Fire planes are extremely hostile to non-fire creatures.", null, null, null, null, null, "Fire", null },
                    { new Guid("ae21e02b-11a1-4c53-96ec-5961beb2761d"), null, null, null, null, null, null, "Effects with the water trait either manipulate or conjure water. Those that manipulate water have no effect in an area without water. Creatures with this trait consist primarily of water or have a magical connection to the element. Planes with this trait are mostly liquid, perhaps with pockets of breathable air.", null, null, null, null, null, "Water", null },
                    { new Guid("7cb74b87-4e13-4d8c-afa5-da8cbe671bfc"), null, null, null, null, null, null, "Effects with the air trait either manipulate or conjure air. Those that manipulate air have no effect in a vacuum or an area without air. Creatures with this trait consist primarily of air or have a magical connection to that element. Planes with this trait consist mostly of open spaces and air with various degrees of turbulence, though they also contain rare islands of floating stone and other elements and energies.", null, null, null, null, null, "Air", null },
                    { new Guid("11d74166-043d-4f9d-93eb-8ae813e2b840"), null, null, null, null, null, null, "On a critical hit, the weapon adds a weapon damage die of the listed size. Roll this after doubling the weapon’s damage. This increases to two dice if the weapon has a greater striking rune and three dice if the weapon has a major striking rune. For instance, a rapier with a greater striking rune deals 2d8 extra piercing damage on a critical hit. An ability that changes the size of the weapon’s normal damage dice doesn’t change the size of its deadly die.", null, null, null, null, null, "Deadly", null },
                    { new Guid("e55f102e-414e-4210-b1b3-97d8c26bab6a"), null, null, null, null, null, null, "Effects with this trait deal force damage or create objects made of pure magical force.", null, null, null, null, null, "Force", null },
                    { new Guid("4fbbdfad-330f-4e0f-92dd-d070a59d7498"), null, null, null, null, null, null, "A general feat with the skill trait improves your skills and their actions or gives you new actions for a skill. A feat with this trait can be selected when a class grants a skill feat or general feat. Archetype feats with the skill trait can be selected in place of a skill feat if you have that archetype’s dedication feat.", null, null, null, null, null, "Skill", null },
                    { new Guid("68d3b3ab-d2ed-4691-8609-7403c843c77f"), null, null, null, null, null, null, "A rules element with this trait is one-of-a-kind. The DC of Recall Knowledge checks related to creatures with this trait is increased by 10.", null, null, null, null, null, "Unique", null },
                    { new Guid("6f187720-6664-44c6-8e09-2053ed1054d6"), null, null, null, null, null, null, "Effects and magic items with this trait are associated with the conjuration school of magic, typically involving summoning, creation, teleportation, or moving things from place to place.", null, null, null, null, null, "Conjuration", null },
                    { new Guid("23655aa4-871f-416f-be14-1fc03bedef16"), null, null, null, null, null, null, "An effect with this trait is not inherently deadly. Damage from a nonlethal effect knocks a creature out rather than killing it. You can use a nonlethal weapon to make a lethal attack with a –2 circumstance penalty.", null, null, null, null, null, "Nonlethal", null },
                    { new Guid("c90d2554-1af6-45d7-9f20-f98aa0799887"), null, null, null, null, null, null, "Light effects overcome non-magical darkness in the area, and can counteract magical darkness. You must usually target darkness magic with your light magic directly to counteract the darkness, but some light spells automatically attempt to counteract darkness.", null, null, null, null, null, "Light", null },
                    { new Guid("aa2b017d-2e8c-460a-9069-6bf61b69dd72"), null, null, null, null, null, null, "Darkness effects extinguish non-magical light in the area, and can counteract less powerful magical light. You must usually target light magic with your darkness magic directly to counteract the light, but some darkness spells automatically attempt to counteract light.", null, null, null, null, null, "Darkness", null },
                    { new Guid("39e2298b-bab0-49b7-8a0a-4ac1145611b0"), null, null, null, null, null, null, "An effect with this trait delivers a poison or deals poison damage. An item with this trait is poisonous and might cause an affliction.", null, null, null, null, null, "Poison", null },
                    { new Guid("574e4077-83a5-4865-95a3-29a556f873ed"), null, null, null, null, null, null, "This poison is delivered by damaging the recipient.", null, null, null, null, null, "Injury", null },
                    { new Guid("551070c6-e73a-4c0c-9a9c-f6425f38f5f0"), null, null, null, null, null, null, "This poison is delivered when breathed in.", null, null, null, null, null, "Inhaled", null },
                    { new Guid("3078e40b-db78-4f39-9ffc-304e6a1993cf"), null, null, null, null, null, null, "This poison is delivered when drunk or eaten.", null, null, null, null, null, "Ingested", null },
                    { new Guid("0b49fe13-7684-43b9-b5a5-81b8c038dc9c"), null, null, null, null, null, null, "This poison is delivered by contact with the skin.", null, null, null, null, null, "Contact", null },
                    { new Guid("c499214b-94fc-4103-8c7c-6f7a56b5c980"), null, null, null, null, null, null, "Effects and magic items with this trait are associated with the abjuration school of magic, typically involving protection or wards.", null, null, null, null, null, "Abjuration", null },
                    { new Guid("d748ac0d-6af3-4475-af4e-a72455960fe0"), null, null, null, null, null, null, "A verbal component is a vocalization of words of power. You must speak them in a strong voice, so it’s hard to conceal that you’re Casting a Spell. The spell gains the concentrate trait. You must be able to speak to provide this component.", null, null, null, null, null, "Verbal", null },
                    { new Guid("a6217da0-ad2a-43a0-88d4-ac85f1d68591"), null, null, null, null, null, null, "An olfactory effect can affect only creatures that can smell it. This applies only to olfactory parts of the effect, as determined by the GM.", null, null, null, null, null, "Olfactory", null },
                    { new Guid("44a18bec-0799-41a7-9b07-16113bb0623f"), null, null, null, null, null, null, "Auditory actions and effects rely on sound. An action with the auditory trait can be successfully performed only if the creature using the action can speak or otherwise produce the required sounds. A spell or effect with the auditory trait has its effect only if the target can hear it. This applies only to sound-based parts of the effect, as determined by the GM. This is different from a sonic effect, which still affects targets who can't hear it (such as deaf targets) as long as the effect itself makes sound.", null, null, null, null, null, "Auditory", null },
                    { new Guid("d751d93f-cff9-448f-8ab0-9a3c07eacbef"), null, null, null, null, null, null, "Effects and magic items with this trait are associated with the transmutation school of magic, typically changing something’s form.", null, null, null, null, null, "Transmutation", null },
                    { new Guid("2d643d25-b9aa-4544-b482-04b3475eb82b"), null, null, null, null, null, null, "Effects and magic items with this trait are associated with the necromancy school of magic, typically involving forces of life and death.", null, null, null, null, null, "Necromancy", null },
                    { new Guid("7f9fe1cb-c607-44c3-8f1a-b26d508cfce6"), null, null, null, null, null, null, "Effects and magic items with this trait are associated with the illusion school of magic, typically involving false sensory stimuli.", null, null, null, null, null, "Illusion", null },
                    { new Guid("f5f7ca8a-100a-4d93-aa07-e0f1bb3cbc49"), null, null, null, null, null, null, "Effects and magic items with this trait are associated with the evocation school of magic, typically involving energy and elemental forces.", null, null, null, null, null, "Evocation", null },
                    { new Guid("e7fd1927-8c01-4945-899e-a99d2e44662a"), null, null, null, null, null, null, "Effects and magic items with this trait are associated with the enchantment school of magic, typically involving mind control, emotion alteration, and other mental effects.", null, null, null, null, null, "Enchantment", null },
                    { new Guid("5bce1594-6c07-460f-b306-0db1fa30833b"), null, null, null, null, null, null, "The divination school of magic typically involves obtaining or transferring information, or predicting events.", null, null, null, null, null, "Divination", null },
                    { new Guid("e2bb08cb-cf59-4e29-8738-52c751405fb0"), null, null, null, null, null, null, "A visual effect can affect only creatures that can see it. This applies only to visible parts of the effect, as determined by the GM.", null, null, null, null, null, "Visual", null },
                    { new Guid("fe4f319f-4792-41f3-be57-689f0eb65321"), null, null, null, null, null, null, "A creature called by a conjuration spell or effect gains the summoned trait. A summoned creature can't summon other creatures, create things of value, or cast spells that require a cost. It has the minion trait. If it tries to cast a spell of equal or higher level than the spell that summoned it, it overpowers the summoning magic, causing the summoned creature's spell to fail and the summon spell to end. Otherwise, the summoned creature uses the standard abilities for a creature of its kind. It generally attacks your enemies to the best of its abilities. If you can communicate with it, you can attempt to command it, but the GM determines the degree to which it follows your commands. Immediately when you finish Casting the Spell, the summoned creature uses its 2 actions for that turn. A summoned creature can't control any spawn or other creatures generated from it, and such creatures return to their unaltered state (usually a corpse in the case of spawn) once the summoned creature is gone. If it's unclear what this state would be, the GM decides. Summoned creatures can be banished by various spells and effects. They are automatically banished if reduced to 0 Hit Points or if the spell that called them ends.", null, null, null, null, null, "Summon", null }
                });

