                    { new Guid("4d045584-3a7f-433b-ad89-0f658c379923"), null, "Stunned", new Guid("f253f20f-d7d3-4fe6-bb19-8d521afd9436"), new Guid("4e85ec44-4a72-4bea-a3e5-5e6d88882d75") },
                    { new Guid("10ef1d07-27bd-4073-96f7-2a55a05a9831"), new Guid("18744a3c-8c8d-4298-8be7-f5e7e5dc0a6b"), "Unconscious", new Guid("ff7b682f-13ff-464f-a230-89cc814186ea"), new Guid("4e85ec44-4a72-4bea-a3e5-5e6d88882d75") },
