            migrationBuilder.InsertData(
                table: "Conditions_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("54bff588-112b-46db-a7b9-eeeaf955a417"), 0, new Guid("f253f20f-d7d3-4fe6-bb19-8d521afd9436"), "You have fewer actions. Slowed always includes a value. When you regain your actions at the start of your turn, reduce the number of actions you regain by your slowed value. Because slowed has its effect at the start of your turn, you don’t immediately lose actions if you become slowed during your turn.", 0 },
                    { new Guid("7577f633-3d1c-4a3d-a71b-6310daabf88e"), 0, new Guid("a9bb8a46-7442-4480-b008-c706d7d4ef2f"), "Your thoughts and instincts are clouded. Stupefied always includes a value. You take a status penalty equal to this value on Intelligence-, Wisdom-, and Charisma-based checks and DCs, including Will saving throws, spell attack rolls, spell DCs, and skill checks that use these ability scores. Any time you attempt to Cast a Spell while stupefied, the spell is disrupted unless you succeed at a flat check with a DC equal to 5 + your stupefied value.", 0 },
                    { new Guid("08040555-c8af-43ef-bd71-ba3500bf3ff4"), 0, new Guid("d7416bc0-79b9-42c0-9335-e420dd3e0f50"), "When you are undetected by a creature, that creature cannot see you at all, has no idea what space you occupy, and can’t target you, though you still can be affected by abilities that target an area. When you’re undetected by a creature, that creature is flat-footed to you.", 0 },
                    { new Guid("c738f0a6-bf21-43d4-a869-12019f22a359"), 0, new Guid("ca2e35fe-8529-4ba3-a860-1bbde1c1c8f8"), "This condition reflects a creature’s disposition toward a particular character, and only supernatural effects (like a spell) can impose this condition on a PC. A creature that is unfriendly to a character dislikes and specifically distrusts that character. The unfriendly creature won’t accept Requests from the character.", 0 },
                    { new Guid("a411f8ea-e37b-4cc7-a8c2-0dfb167537f7"), 2, new Guid("d7416bc0-79b9-42c0-9335-e420dd3e0f50"), "A creature can use the Seek action to try to find you, as described on page 471.", 0 },
                    { new Guid("7101deb8-d849-472c-9ec6-13c6921c213e"), 0, new Guid("8f6d81d5-64f1-455e-80c8-7835accb6613"), "You have been seriously injured. If you lose the dying condition and do not already have the wounded condition, you become wounded 1. If you already have the wounded condition when you lose the dying condition, your wounded condition value increases by 1. If you gain the dying condition while wounded, increase your dying condition value by your wounded value.", 0 },
                    { new Guid("0bfacc23-4b09-44c1-a157-49a246b3d704"), 1, new Guid("8f6d81d5-64f1-455e-80c8-7835accb6613"), "The wounded condition ends if someone successfully restores Hit Points to you with Treat Wounds, or if you are restored to full Hit Points and rest for 10 minutes.", 0 },
                    { new Guid("379e4285-0155-4d1d-a2e3-5fb70df0a394"), 1, new Guid("d7416bc0-79b9-42c0-9335-e420dd3e0f50"), "A creature you’re undetected by can guess which square you’re in to try targeting you. It must pick a square and attempt an attack. This works like targeting a hidden creature (requiring a DC 11 flat check, as described on page 466), but the flat check and attack roll are rolled in secret by the GM, who doesn’t reveal whether the attack missed due to failing the flat check, failing the attack roll, or choosing the wrong square.", 0 },
                    { new Guid("d07b32ec-d323-4126-a929-b8205acfdbb8"), 0, new Guid("f0366047-21ca-4f51-971e-4f7c72629b74"), "You’re physically weakened. Enfeebled always includes a value. When you are enfeebled, you take a status penalty equal to the condition value to Strength-based rolls and DCs, including Strength-based melee attack rolls, Strength-based damage rolls, and Athletics checks.", 0 },
                    { new Guid("39ddfdbd-c9a1-47eb-aa6b-96bc572fefda"), 0, new Guid("b680a37e-cf30-4c4b-886f-a713282892af"), "You’re lying on the ground. You are flat-footed and take a –2 circumstance penalty to attack rolls. The only move actions you can use while you’re prone are Crawl and Stand. Standing up ends the prone condition. You can Take Cover while prone to hunker down and gain greater cover against ranged attacks, even if you don’t have an object to get behind, gaining a +4 circumstance bonus to AC against ranged attacks (but you remain flat-footed).", 0 },
                    { new Guid("d8350c52-3a4a-44e0-89d0-6c5cd546bd5e"), 0, new Guid("c674e766-939d-47fa-9c94-80173d59741f"), "You feel ill. Sickened always includes a value. You take a status penalty equal to this value on all your checks and DCs. You can’t willingly ingest anything—including elixirs and potions—while sickened.", 0 },
                    { new Guid("91795d9e-e963-4fe4-98ab-bfc3f00b1b63"), 2, new Guid("8ecb38b2-d7fb-440f-b096-cf381652b2ff"), "If an effect makes an item broken automatically and the item has more HP than its Broken Threshold, that effect also reduces the item’s current HP to the Broken Threshold.", 0 },
                    { new Guid("9d44223c-e20f-49a7-b374-528d6c21e714"), 0, new Guid("740be8e2-cab8-4cbe-8065-fd71a6d2192e"), "Your movements become clumsy and inexact. Clumsy always includes a value. You take a status penalty equal to the condition value to Dexterity-based checks and DCs, including AC, Reflex saves, ranged attack rolls, and skill checks using Acrobatics, Stealth, and Thievery.", 0 },
                    { new Guid("4747231a-c95e-488a-9cf8-6ebef9bfadfa"), 0, new Guid("64d1cfdc-8539-4bf7-95f2-60d53788079b"), "While you are concealed from a creature, such as in a thick fog, you are difficult for that creature to see. You can still be observed, but you’re tougher to target. A creature that you’re concealed from must succeed at a DC 5 flat check when targeting you with an attack, spell, or other effect. Area effects aren’t subject to this flat check. If the check fails, the attack, spell, or effect doesn’t affect you.", 0 },
                    { new Guid("ca756fda-2864-47c4-92a2-46392a99aebb"), 0, new Guid("b9c63a02-449e-43c2-a236-5a3f851f766f"), "You don’t have your wits about you, and you attack wildly. You are flat-footed, you don’t treat anyone as your ally (though they might still treat you as theirs), and you can’t Delay, Ready, or use reactions.", 0 },
                    { new Guid("99b1c88a-5271-4aab-bbb1-e5ec21a4b3b4"), 1, new Guid("b9c63a02-449e-43c2-a236-5a3f851f766f"), "You use all your actions to Strike or cast offensive cantrips, though the GM can have you use other actions to facilitate attack, such as draw a weapon, move so that a target is in reach, and so forth. Your targets are determined randomly by the GM. If you have no other viable targets, you target yourself, automatically hitting but not scoring a critical hit. If it’s impossible for you to attack or cast spells, you babble incoherently, wasting your actions.", 0 },
                    { new Guid("631ddfce-8c66-467a-bb23-d5618e11b941"), 2, new Guid("b9c63a02-449e-43c2-a236-5a3f851f766f"), "Each time you take damage from an attack or spell, you can attempt a DC 11 flat check to recover from your confusion and end the condition.", 0 },
                    { new Guid("672f53e9-c341-4d76-befe-8f2f97c3d693"), 0, new Guid("d4d10f5f-e6cc-4acc-a8b3-3a29de451366"), "Someone else is making your decisions for you, usually because you’re being commanded or magically dominated. The controller dictates how you act and can make you use any of your actions, including attacks, reactions, or even Delay. The controller usually does not have to spend their own actions when controlling you.", 0 },
                    { new Guid("fae04dbc-8bb8-4771-b3a0-32b0b0da09f8"), 0, new Guid("ff7b682f-13ff-464f-a230-89cc814186ea"), "Your eyes are overstimulated. If vision is your only precise sense, all creatures and objects are concealed from you.", 0 },
                    { new Guid("d5009a32-f90e-465d-a23d-c0d1bf4957e7"), 1, new Guid("8ecb38b2-d7fb-440f-b096-cf381652b2ff"), "A broken item still imposes penalties and limitations normally incurred by carrying, holding, or wearing it. For example, broken armor would still impose its Dexterity modifier cap, check penalty, and so forth.", 0 },
                    { new Guid("24e658a1-86a6-40da-86a3-6f67b13d4598"), 0, new Guid("3c3ce9f5-aceb-4db8-810a-1291035cf709"), "After you die, you can’t act or be affected by spells that target creatures (unless they specifically target dead creatures), and for all other purposes you are an object. When you die, you are reduced to 0 Hit Points if you had a different amount, and you can’t be brought above 0 Hit Points as long as you remain dead. Some magic can bring creatures back to life, such as the resurrect ritual or the raise dead spell.", 0 },
                    { new Guid("9403c4ab-8ecf-4cba-921d-33164c193893"), 0, new Guid("31b26b64-2616-4d23-93de-f3dbc0c81b7d"), "You can’t hear. You automatically critically fail Perception checks that require you to be able to hear. You take a –2 status penalty to Perception checks for initiative and checks that involve sound but also rely on other senses. If you perform an action with the auditory trait, you must succeed at a DC 5 flat check or the action is lost; attempt the check after spending the action but before any effects are applied. You are immune to auditory effects.", 0 },
                    { new Guid("8cf1621e-3546-4afa-a642-b9230fdb4738"), 0, new Guid("824a03c0-0108-4896-8c0a-8af3a09cd738"), "A powerful force has gripped your soul, calling you closer to death. Doomed always includes a value. The dying value at which you die is reduced by your doomed value. If your maximum dying value is reduced to 0, you instantly die. When you die, you’re no longer doomed.", 0 },
                    { new Guid("78319886-dc7a-4b52-bf06-737bd98c21e3"), 1, new Guid("824a03c0-0108-4896-8c0a-8af3a09cd738"), "Your doomed value decreases by 1 each time you get a full night’s rest.", 0 },
                    { new Guid("89509236-9bb3-418e-be29-e31380949594"), 0, new Guid("a263fc00-a122-416e-8213-a7214fa9a30f"), "When a creature successfully drains you of blood or life force, you become less healthy. Drained always includes a value. You take a status penalty equal to your drainedvalue on Constitution-based checks, such as Fortitude saves. You also lose a number of Hit Points equal to your level (minimum 1) times the drained value, and your maximum Hit Points are reduced by the same amount. For example, if you’re hit by an effect that inflicts drained 3 and you’re a 3rd-level character, you lose 9 Hit Points and reduce your maximum Hit Points by 9. Losing these Hit Points doesn’t count as taking damage.", 0 },
                    { new Guid("0b8cf255-bc93-4438-ad6d-efba1a02255e"), 1, new Guid("a263fc00-a122-416e-8213-a7214fa9a30f"), "Each time you get a full night’s rest, your drained value decreases by 1. This increases your maximum Hit Points, but you don’t immediately recover the lost Hit Points.", 0 },
                    { new Guid("cbf8d506-afc9-41c1-9d3f-22372c9a3bc3"), 0, new Guid("069fffa5-3fe0-4892-a04d-1bd28a6225a3"), "You are bleeding out or otherwise at death’s door. While you have this condition, you are unconscious. Dying always includes a value, and if it ever reaches dying 4, you die. If you’re dying, you must attempt a recovery check (page 459) at the start of your turn each round to determine whether you get better or worse. Your dying condition increases by 1 if you take damage while dying, or by 2 if you take damage from an enemy’s critical hit or a critical failure on your save.", 0 },
                    { new Guid("83f9a4be-3255-4103-a0f9-d5517de0b245"), 1, new Guid("069fffa5-3fe0-4892-a04d-1bd28a6225a3"), "If you lose the dying condition by succeeding at a recovery check and are still at 0 Hit Points, you remain unconscious, but you can wake up as described in that condition. You lose the dying condition automatically and wake up if you ever have 1 Hit Point or more. Any time you lose the dying condition, you gain the wounded 1 condition, or increase your wounded condition value by 1 if you already have that condition.", 0 },
                    { new Guid("29645e9c-1185-49a9-be03-ff02cd827421"), 0, new Guid("5da2ad79-54a0-429e-a52a-d654841fb268"), "You are carrying more weight than you can manage. While you’re encumbered, you’re clumsy 1 and take a 10-foot penalty to all your Speeds. As with all penalties to your Speed, this can’t reduce your Speed below 5 feet.", 0 },
                    { new Guid("b53d24af-320c-4f46-b25a-d65dd014713b"), 0, new Guid("48d6ee37-8a18-4162-9164-9f7892045d2d"), "You’re tired and can’t summon much energy. You take a –1 status penalty to AC and saving throws. You can’t use exploration activities performed while traveling, such as those on pages 479–480.", 0 },
                    { new Guid("82673ddd-1dab-44ae-bb04-c8cc8c57d0a8"), 1, new Guid("c674e766-939d-47fa-9c94-80173d59741f"), "You can spend a single action retching in an attempt to recover, which lets you immediately attempt a Fortitude save against the DC of the effect that made you sickened. On a success, you reduce your sickened value by 1 (or by 2 on a critical success).", 0 },
                    { new Guid("4ccf1630-ee1b-4a52-b41a-d80832acccc8"), 0, new Guid("8ecb38b2-d7fb-440f-b096-cf381652b2ff"), "Broken is a condition that affects objects. An object is broken when damage has reduced its Hit Points to equal or less than its Broken Threshold. A broken object can’t be used for its normal function, nor does it grant bonuses— with the exception of armor. Broken armor still grants its item bonus to AC, but it also imparts a status penalty to AC depending on its category: –1 for broken light armor, –2 for broken medium armor, or –3 for broken heavy armor.", 0 },
                    { new Guid("e1d864f8-5b68-4c68-b26a-b615fcddef91"), 0, new Guid("72287426-a2d9-4d8b-8b2a-9a696baa3f1d"), "You’re distracted or otherwise unable to focus your full attention on defense. You take a –2 circumstance penalty to AC. Some effects give you the flat-footed condition only to certain creatures or against certain attacks. Others— especially conditions—can make you universally flatfooted against everything. If a rule doesn’t specify that the condition applies only to certain circumstances, it applies to all of them; for example, many effects simply say “The target is flat-footed.”", 0 },
                    { new Guid("0df66944-a5b6-40d4-a9ce-d00c4d2a0edb"), 0, new Guid("fce417f7-0b9c-4d87-9f0a-45ae5d9a4e53"), "You gain 1 additional action at the start of your turn each round. Many effects that make you quickened specify the types of actions you can use with this additional action. If you become quickened from multiple sources, you can use the extra action you’ve been granted for any single action allowed by any of the effects that made you quickened. Because quickened has its effect at the start of your turn, you don’t immediately gain actions if you become quickened during your turn.", 0 },
                    { new Guid("7fe8edf9-1e44-4603-bbab-612a53f2dbc8"), 1, new Guid("b680a37e-cf30-4c4b-886f-a713282892af"), "If you would be knocked prone while you’re Climbing or Flying, you fall (see pages 463–464 for the rules on falling). You can’t be knocked prone when Swimming.", 0 },
                    { new Guid("5a517c41-8680-4408-bbae-7bbc60409082"), 0, new Guid("33b600ff-067e-4a67-a1ce-c85cf2d2382c"), "You are compelled to focus your attention on something, distracting you from whatever else is going on around you. You take a –2 status penalty to Perception and skill checks, and you can’t use actions with the concentrate trait unless they or their intended consequences are related to the subject of your fascination (as determined by the GM). For instance, you might be able to Seek and Recall Knowledge about the subject, but you likely couldn’t cast a spell targeting a different creature. This condition ends if a creature uses hostile actions against you or any of your allies.", 0 },
                    { new Guid("ed6d12ad-822b-45cb-89b3-4318fa50053a"), 0, new Guid("8d531baa-8a75-4090-83d0-fd8721b76ae7"), "You have been turned to stone. You can’t act, nor can you sense anything. You become an object with a Bulk double your normal Bulk (typically 12 for a petrified Medium creature or 6 for a petrified Small creature), AC 9, Hardness 8, and the same current Hit Points you had when alive. You don’t have a Broken Threshold. When you’re turned back into flesh, you have the same number of Hit Points you had as a statue. If the statue is destroyed, you immediately die. While petrified, your mind and body are in stasis, so you don’t age or notice the passing of time.", 0 },
                    { new Guid("61aba62f-6e0b-47e6-87dc-cf5d1f2958f3"), 0, new Guid("e224b6c0-c7aa-4a58-b00f-7c422a7c6250"), "Persistent damage comes from effects like acid, being on fire, or many other situations. It appears as “X persistent [type] damage,” where “X” is the amount of damage dealt and “[type]” is the damage type. Instead of taking persistent damage immediately, you take it at the end of each of your turns as long as you have the condition, rolling any damage dice anew each time. After you take persistent damage, roll a DC 15 flat check to see if you recover from the persistent damage. If you succeed, the condition ends.", 0 },
                    { new Guid("0ecf6343-5513-4313-817c-2fee4c074167"), 0, new Guid("5007c3b2-b184-43b1-85d7-ad159d14ccb5"), "You are frozen in place. You have the flat-footed condition and can’t act except to Recall Knowledge and use actions that require only your mind (as determined by the GM). Your senses still function, but only in the areas you can perceive without moving, so you can’t Seek while paralyzed.", 0 },
                    { new Guid("0a8a7135-4b51-4671-963e-e1c99a28a9fe"), 0, new Guid("6f1426bc-454d-4796-a6b5-a1569dd39ee6"), "Anything in plain view is observed by you. If a creature takes measures to avoid detection, such as by using Stealth to Hide, it can become hidden or undetected instead of observed. If you have another precise sense instead of or in addition to sight, you might be able to observe a creature or object using that sense instead. You can observe a creature only with precise senses. When Seeking a creature using only imprecise senses, it remains hidden, rather than observed.", 0 },
                    { new Guid("1d7e6205-8464-4e8b-9909-0ddb38f7849d"), 0, new Guid("b9db96ae-7d84-4616-8831-477d614b4dbd"), "While invisible, you can’t be seen. You’re undetected to everyone. Creatures can Seek to attempt to detect you; if a creature succeeds at its Perception check against your Stealth DC, you become hidden to that creature until you Sneak to become undetected again. If you become invisible while someone can already see you, you start out hidden to the observer (instead of undetected) until you successfully Sneak. You can’t become observed while invisible except via special abilities or magic.", 0 },
                    { new Guid("ab4a8033-4de6-4f8c-bd8c-8576da289805"), 1, new Guid("48d6ee37-8a18-4162-9164-9f7892045d2d"), "You recover from fatigue after a full night’s rest.", 0 },
                    { new Guid("291d7186-938c-4caf-a163-8311f6fa9ce3"), 0, new Guid("f13e0f97-112a-4ffa-843a-00b406ee963d"), "This condition reflects a creature’s disposition toward a particular character, and only supernatural effects (like a spell) can impose this condition on a PC. A creature that is indifferent to a character doesn’t really care one way or the other about that character. Assume a creature’s attitude to a given character is indifferent unless specified otherwise.", 0 },
                    { new Guid("c921983d-388a-4891-b90b-7f024cfc9b6b"), 0, new Guid("d56a5083-fa2f-4d9c-a968-0b7664e1c9cd"), "This condition reflects a creature’s disposition toward a particular character, and only supernatural effects (like a spell) can impose this condition on a PC. A creature that is hostile to a character actively seeks to harm that character. It doesn’t necessarily attack, but it won’t accept Requests from the character.", 0 },
                    { new Guid("891ef18a-15d1-4256-b2b9-c67320503e38"), 1, new Guid("4f1b10d8-98e2-43f2-b3a4-22e6b11ea699"), "A creature might be able to use the Seek action to try to observe you, as described on page 471.", 0 },
                    { new Guid("1b0fb05d-5c1a-429c-9a8e-65729fa82c9e"), 0, new Guid("4f1b10d8-98e2-43f2-b3a4-22e6b11ea699"), "While you’re hidden from a creature, that creature knows the space you’re in but can’t tell precisely where you are. You typically become hidden by using Stealth to Hide. When Seeking a creature using only imprecise senses, it remains hidden, rather than observed. A creature you’re hidden from is flat-footed to you, and it must succeed at a DC 11 flat check when targeting you with an attack, spell, or other effect or it fails to affect you. Area effects aren’t subject to this flat check.", 0 },
                    { new Guid("38e865fe-53ed-43bd-b220-3c9498fca119"), 0, new Guid("170bff5c-bcac-433d-94a0-840da90112af"), "This condition reflects a creature’s disposition toward a particular character, and only supernatural effects (like a spell) can impose this condition on a PC. A creature that is helpful to a character wishes to actively aid that character. It will accept reasonable Requests from that character, as long as such requests aren’t at the expense of the helpful creature’s goals or quality of life. If the character or one of their allies uses a hostile action against the creature, the creature gains a worse attitude condition depending on the severity of the hostile action, as determined by the GM.", 0 },
                    { new Guid("355e56d4-13ed-47e0-a9ca-9a79ce8d41b9"), 0, new Guid("918a03c5-27d2-458f-8bbf-2d1933738415"), "You’re held in place by another creature, giving you the flat-footed and immobilized conditions. If you attempt a manipulate action while grabbed, you must succeed at a DC 5 flat check or it is lost; roll the check after spending the action, but before any effects are applied.", 0 },
                    { new Guid("b7dabd8d-11d5-4498-a799-c904741c3619"), 0, new Guid("06cdc6c0-2d59-414e-a1bf-1d1862bae2d7"), "You’re gripped by fear and struggle to control your nerves. The frightened condition always includes a value. You take a status penalty equal to this value to all your checks and DCs. Unless specified otherwise, at the end of each of your turns, the value of your frightened condition decreases by 1.", 0 },
                    { new Guid("44d2d929-9e51-4618-b433-df0633852619"), 0, new Guid("87851575-72a5-4935-b284-7cb0551fadf2"), "This condition reflects a creature’s disposition toward a particular character, and only supernatural effects (like a spell) can impose this condition on a PC. A creature that is friendly to a character likes that character. The character can attempt to make a Request of a friendly creature, and the friendly creature is likely to agree to a simple and safe request that doesn’t cost it much to fulfill. If the character or one of their allies uses hostile actions against the creature, the creature gains a worse attitude condition depending on the severity of the hostile action, as determined by the GM.", 0 },
                    { new Guid("92d8268f-caec-4b0e-abe6-3d325bf3746e"), 0, new Guid("35e06ece-e68a-4201-a215-8e3a29f30840"), "You’re forced to run away due to fear or some other compulsion. On your turn, you must spend each of your actions trying to escape the source of the fleeing condition as expediently as possible (such as by using move actions to flee, or opening doors barring your escape). The source is usually the effect or caster that gave you the condition, though some effects might define something else as the source. You can’t Delay or Ready while fleeing.", 0 },
                    { new Guid("eebe0f58-737c-4da3-a349-45e68247f56b"), 0, new Guid("b335312b-5956-436b-a8df-c426704a41ba"), "You can’t use any action with the move trait. If you’re immobilized by something holding you in place and an external force would move you out of your space, the force must succeed at a check against either the DC of the effect holding you in place or the relevant defense (usually Fortitude DC) of the monster holding you in place.", 0 },
                    { new Guid("a1b5f2c5-4799-468a-a3aa-7742b80487d5"), 1, new Guid("3c3ce9f5-aceb-4db8-810a-1291035cf709"), "This is not an official status condition, but a pf2e.io liberty to smooth out some of the inconsistencies in the rulesbooks.", 3 }
                });

