            migrationBuilder.InsertData(
                table: "Diseases",
                columns: new[] { "Id", "Description", "DifficultyCheck", "Name", "Onset", "SavingThrowStatId", "SourcePageId", "Spoilers", "TraitsId" },
                values: new object[,]
                {
                    { new Guid("9e6fec9d-0ab3-450e-a0fa-a074ca4b4b6c"), "Many healers and alchemists suspect that sewer haze has a supernatural origin, given its association with particularly strong otyughs.", 23, "Sewer Haze", "2 Days", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("9f757d30-7c60-4217-a742-613ae6bb3830"), false, null },
                    { new Guid("c98d0053-6cb5-4116-aab4-a16257f09d6a"), "Endemic to jungles of the Mwangi Expanse, blinding sickness is transmitted by dirty water or the bites of certain creatures.", 23, "Blinding Sickness", "Immediate", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("67b3423d-e15f-4997-81b5-f832f703e76f"), false, null },
                    { new Guid("e2848bfd-24f3-4512-b106-d7112316b282"), "Scarlet leprosy is widely feared for its devastating effects, crushing bones and organs while making recovery nearly impossible.Damage taken from scarlet leprosy can’t be healed until the disease is cured.", 19, "Scarlet Leprosy", "1 Day", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("65377178-dd5a-4a62-9d02-9b54f2a60ab6"), false, null },
                    { new Guid("f8e30bb2-a932-44b8-bc10-d958d2094645"), "he relatively simple sore throat caused by this disease leads many victims to initially dismiss it as a mild illness, but scarlet fever can be deadly if left untreated. You can’t reduce your sickened condition while affected with scarlet fever.", 13, "Scarlet Fever", "2 Days", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("664e842a-4b94-4d00-836d-4191c3b5df50"), false, null },
                    { new Guid("131aef55-4306-47c2-a9d6-3200c8146154"), "No description was provided for this disease.", 18, "Cocytan Filth", "1d4 Days", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("1960dd05-ab39-4e03-9913-43f1d1b6a1b2"), false, null },
                    { new Guid("3ba38de5-8542-42e3-a2d4-13f4710177fa"), "No description was provided for this disease.", 29, "Daemonic Famine", "Immediate", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("9ed612bb-91ee-4372-b68a-36eac922bee1"), false, null },
                    { new Guid("944b86e1-373a-4bb8-bf00-2c8a2664cdd2"), "Thought to be caused by a night hag’s curse, nightmare fever inflicts you with terrible nightmares, and you awaken with the wounds you received in your dreams. Some versions cause you to dream of being wounded by bludgeoning or piercing weapons, in which case you take that type of damage instead. Damage and the fatigued condition caused by the disease can’t be healed until the disease is removed.", 25, "Nightmare Fever", "Immediate", new Guid("a71929b0-9dff-492a-9bf9-8f9cadda198c"), new Guid("cc5aec5c-f514-4626-bfe3-e62fcd7c8e3a"), false, null },
                    { new Guid("390c8350-3289-4f72-92ad-3490b8d0f8b5"), "A ghonhatine’s vomit carries an awful disease that, over time, can cause a suffering creature’s flesh to develop painful boils that eventually slough away, leaving gaping wounds", 28, "Fleshgout", "Immediate", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("7f3561ed-7175-4f9f-b654-8e25dee7c37b"), false, null },
                    { new Guid("a126527c-f9d1-498f-9d53-ee01009a80e5"), "An akata implants its parasitic larval young into any creature it bites, but only Medium or Small humanoids make suitable hosts; all other creatures are immune to this disease", 17, "Void Death", "1 Day", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("5108e12f-9672-4072-a697-d7602a132ccc"), false, null },
                    { new Guid("7e8fdfa0-6ccd-456b-ad87-c7bc0512fe93"), "A pernicious disease spread by bloodsucking insects, malaria sometimes enters long periods of dormancy. If you succumb to malaria, you may continue to be periodically affected by the disease, even if you’re cured. You can’t reduce your sickened condition while affected with malaria.", 16, "Malaria", "10 Days", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("1746a261-7039-411f-b5b4-f40901a436a6"), false, null },
                    { new Guid("13952f0f-9ded-47eb-880c-415028b67700"), "A giant fly could carry any disease, but most transmit a virulent but not fatal infection called Fly Pox with their bite", 16, "Fly Pox", "1 Day", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("13952f0f-9ded-47eb-880c-415028b67700"), false, null },
                    { new Guid("b11eaf26-1dfd-4ebb-95c4-4ed05af41ec4"), "This devastating fungus infects your hand and can be cured by amputating the limb before you reach stage 4.", 34, "Crimson Ooze", "Immediate", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("0f9d2b87-94d8-4c77-b447-a0ac6afb81f4"), false, null },
                    { new Guid("aae01797-c896-4665-9681-4caae8d37800"), "This disease is capable of wiping out nations or even entire continents. A few pockets of the disease still remain in Iobaria, keeping that region’s population sparse.", 22, "Choking Death", "1 Day", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("0e5abee1-6553-400c-a667-41bae3f6acfb"), false, null },
                    { new Guid("df53fbce-7ea5-4882-8aac-d589381514b2"), "Track the maximum stage you reach with each drug’s addiction. This maximum stage is separate from your current addiction stage for the drug. The maximum stage can’t be reduced, even if you fully remove the disease. When you take the drug, two things happen: you attempt a saving throw against addiction, and you suppress the effects of addiction for 1 day. Failing a save against addiction caused by taking the drug causes you to go to 1 stage higher than the maximum stage you had previously reached (2 stages higher on a critical failure). If you’re currently suffering from addiction when you attempt a save from taking the drug, you can’t improve your stage; if you succeed at the save, the stage remains the same as it was. When you attempt your save against addiction each week, the stage you are currently at can’t get worse—it can only stay the same or improve. The conditions from addiction can’t be removed while you are affected by the addiction, and suppressing addiction by taking the drug only avoids the effects—it doesn’t remove the disease.", null, "Addiction", "1 day", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("480e5953-ecf3-4be4-abe8-d2ef95e6dc44"), false, null },
                    { new Guid("94d803e5-9777-4b7f-96bf-0df87af5455f"), "Scholars suspect these brain parasites have an otherworldly or extraplanar origin. Though transmitted by the bites of infected targets, the disease remains relatively rare—most hosts are killed by the effects before they can pass it on. While infected, whenever you attack due to confusion, you bite your target (if you don’t have a jaws or fangs attack, you deal piercing damage as an unarmed attack with damage equal to your lowest unarmed attack).", 28, "Brain Worms", "1 Day", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("a2a53bc0-a6be-43ed-9427-b54ab63abdc3"), false, null },
                    { new Guid("bdc9c07d-a3bf-4dc1-9ff1-657d2e956e17"), "Sometimes called bog foot, bog rot is caused by having waterlogged feet for an extended period of time. In addition to the usual cures for an affliction, bog rot can be cured through amputation of the affected appendages.", 13, "Bog Rot", "1 Day", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("11ad942d-bb19-460c-a802-2db23239e202"), false, null },
                    { new Guid("ab42f014-7b09-488b-a429-b2bf829cf5f2"), "This widespread illness can sweep through entire communities, leaving few unaffected. The first indication of the disease is a telltale swelling of glands. In some cases, the disease can move into your lungs (pneumonic plague) or blood (septicemic plague), which is even more fatal. If you have bubonic plague, you can’t remove the fatigued condition while affected.", 17, "Bubonic Plague", "1 Day", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("8cd04e7c-ddd9-44eb-b774-cc90221b157b"), false, null },
                    { new Guid("ca8a8c1e-0426-48a4-81f3-38fbc309d348"), "An infection introduced through open wounds, tetanus can produce stiffness, muscle spasms strong enough to break bones, and ultimately death.", 14, "Tetanus", "10 Days", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("4ae81453-5952-413b-a8eb-0baab2ae85d9"), false, null },
                    { new Guid("0420dbd7-79bc-420d-b926-6f1d66f6d14e"), "If you are wounded and exposed to persistent cold, you might contract bonechill.", 20, "Bonechill", "1 Day", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("9e838c4f-13ff-4587-a840-f4bc36a01360"), false, null },
                    { new Guid("1ff214ef-2c78-4662-89c1-b541b06c93a0"), "The ceiling of the vault of the Black Desert is studded with deadly crystals that glimmer like stars above the dark sands. These crystals are radioactive and flood the vault with lethal energy. Creatures other than those native to the vault or who have survived there for a long time develop a disease called blightburn sickness. Creatures native to the Black Desert are immune, as are creatures who are affected by blightburn sickness but recover from it. The target can't recover from the disease's drained or sickened condition except by magic. The surest way to avoid contracting blightburn sickness is by wearing a blightburn ward, a piece of protective jewelry often found among urdefhans' gear or for sale in Shraen.", 32, "Blightburn Sickness", "1d4 Days", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("26ed3169-4bdd-4ff2-8392-3ea20f036ae9"), true, null },
                    { new Guid("f644ab8a-66c3-4c79-8ac7-b3aeddf5ac19"), "An extended respiratory disease, tuberculosis can pose particular challenges to spellcasters and some performers due to the intense coughing fits it produces.", 15, "Tuberculosis", "1 Week", new Guid("83f532a1-dad3-4dc8-b13d-77e69959444a"), new Guid("72e51025-a0c7-4fac-9944-d44fa353d2cf"), false, null }
                });

