            migrationBuilder.InsertData(
                table: "Feats_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("e6d543e3-8f19-45b3-ade2-59d9525160eb"), 0, new Guid("a3395df1-fc95-4989-833c-c0d7465ecd1c"), "You have incredible breath control, which grants you advantages when air is hazardous or sparse. You can hold your breath for 25 times as long as usual before suffocating. You gain a +1 circumstance bonus to saving throws against inhaled threats, such as inhaled poisons, and if you roll a success on such a saving throw, you get a critical success instead.", 0 },
                    { new Guid("af6883b2-2994-4d9a-825e-0aaf92040d99"), 0, new Guid("67a42abf-7456-4bca-a74b-ef8d2fdc4459"), "You can study details in the wilderness to determine the presence of nearby creatures. You can spend 10 minutes assessing the area around you to find out what creatures are nearby, based on nests, scat, and marks on vegetation. Attempt a Survival check against a DC determined by the GM based on how obvious the signs are. On a success, you can attempt a Recall Knowledge check with a –2 penalty to learn more about the creatures just from these signs. If you’re a master in Survival, you don’t take the penalty.", 0 },
                    { new Guid("755917de-c9d7-4d39-a1ea-9e6c72ab7885"), 0, new Guid("f725b35e-73bc-45b9-b5ee-6dfb225147b4"), "You’re skilled at moving with a group. When you are Avoiding Notice and your allies Follow the Expert, you and those allies can roll a single Stealth check, using the lowest modifier, instead of rolling separately. This doesn’t apply for initiative rolls.", 0 },
                    { new Guid("a9300d60-b3e5-4b0b-9376-75a590caf556"), 2, new Guid("3f62ad52-d80b-4662-979c-6eb66a224801"), "Multiple smaller creatures or creatures with significantly smaller appetites than a human are counted as a single creature for this feat, and larger creatures or those with significantly greater appetites each count as multiple creatures. The GM determines how much a non-human creature needs to eat.", 0 },
                    { new Guid("0f251d56-cfff-45a5-9133-ddda22b51196"), 0, new Guid("0f49189c-434c-4490-8cbe-5235e6274441"), "In situations where you can physically menace the target when you Coerce or Demoralize, you gain a +1 circumstance bonus to your Intimidation check and you ignore the penalty for not sharing a language. If your Strength score is 20 or higher and you are a master in Intimidation, this bonus increases to +2.", 0 },
                    { new Guid("a6f780cc-319d-4c0e-84b5-18dd1f1b3889"), 1, new Guid("3f62ad52-d80b-4662-979c-6eb66a224801"), "Each time your proficiency rank in Survival increases, double the number of additional creatures you can take care of on a success (to eight if you’re an expert, 16 if you’re a master, or 32 if you’re legendary). You can choose to care for half the number of additional creatures and provide a comfortable living instead of subsistence living.", 0 },
                    { new Guid("b1851b98-e05d-4c7a-bed7-90b4e44ddc0a"), 0, new Guid("171b6ae6-cda9-45a7-8c0a-64672e338e0b"), "Your fame has spread throughout the lands (for instance, if you have Warfare Lore, you might be a legendary general or tactician). This works as Legendary Performer above, except you gain higher-level jobs when you Earn Income with Lore.", 0 },
                    { new Guid("78f751ba-70e0-475e-89fc-d2f5f5006e43"), 0, new Guid("2818e8e6-4d55-4f83-ad45-6decff2673c1"), "When you successfully Steal something, observers (creatures other than the creature you stole from) take a –2 circumstance penalty to their Perception DCs to detect your theft. Additionally, if you first Create a Diversion using Deception, taking a single Palm an Object or Steal action doesn’t end your undetected condition.", 0 },
                    { new Guid("1fe89bb7-ca01-4a5f-9d34-8699b45c9829"), 0, new Guid("5ac7371e-af01-460e-a188-198481c67505"), "When you roll initiative, you can yell a mighty battle cry and Demoralize an observed foe as a free action. If you’re legendary in Intimidation, you can use a reaction to Demoralize your foe when you critically succeed at an attack roll.", 0 },
                    { new Guid("9f681c15-5e28-4526-9a4c-aebaf2ec9179"), 0, new Guid("ec332db6-b06a-4a93-9935-756953f7a857"), "You’ve researched many faiths enough to recognize notions about them that are unlikely to be true. If you roll a critical failure at a Religion check to Decipher Writing of a religious nature or to Recall Knowledge about the tenets of faiths, you get a failure instead. When attempting to Recall Knowledge about the tenets of your own faith, if you roll a failure, you get a success instead, and if you roll a success, you get a critical success instead.", 0 },
                    { new Guid("aa2b2d06-a965-4e6a-ba72-099e3d2b4def"), 0, new Guid("30763d23-d261-4295-b636-f94bca378bec"), "If you are trained in the appropriate skill for the spell’s tradition and it’s a common spell of 2nd level or lower, you automatically identify it (you still roll to attempt to get a critical success, but can’t get a worse result than success). The highest level of spell you automatically identify increases to 4 if you’re an expert, 6 if you’re a master, and 10 if you’re legendary. The GM rolls a secret Arcana, Nature, Occultism, or Religion check, whichever corresponds to the tradition of the spell being cast. If you’re not trained in the skill, you can’t get a result better than failure.", 0 },
                    { new Guid("89245459-0885-4ec0-bab4-0ce44729a508"), 0, new Guid("3f62ad52-d80b-4662-979c-6eb66a224801"), "While using Survival to Subsist, if you roll any result worse than a success, you get a success. On a success, you can provide subsistence living for yourself and four additional creatures, and on a critical success, you can take care of twice as many creatures as on a success.", 0 },
                    { new Guid("d5968cb8-d28f-4615-a56a-00d65455649b"), 0, new Guid("d1f81e6f-f97f-4bf3-8ddb-7db5ff7c351c"), "You can Steal or Palm an Object that’s closely guarded, such as in a pocket, without taking the –5 penalty. You can’t steal objects that would be extremely noticeable or time consuming to remove (like worn shoes or armor or actively wielded objects). If you’re a master in Thievery, you can attempt to Steal from a creature in combat or otherwise on guard. When doing so, Stealing requires 2 manipulate actions instead of 1, and you take a –5 penalty.", 0 },
                    { new Guid("99c2075b-62d3-4927-8c61-c6d4f79d7fd9"), 0, new Guid("89a41605-0006-4a7b-a101-f73d32f75a04"), "You can bully others with just a few choice implications. You can Coerce a creature after 1 round of conversation instead of 1 minute. You still can’t Coerce a creature in the midst of combat, or without engaging in a conversation.", 0 },
                    { new Guid("a36d8e49-5dd2-44c2-acb0-89d69ed09e80"), 0, new Guid("fccdaf8a-46b0-4a18-9a90-dbb228317b58"), "You are adept at foiling creatures’ special senses and cautious enough to safeguard against them at all times. Whenever you use the Avoid Notice, Hide, or Sneak actions, you are always considered to be taking precautions against special senses (see the Detecting with Other Senses sidebar on page 465).", 0 },
                    { new Guid("d0dfc3c2-425e-4551-9964-bbdf182c468b"), 0, new Guid("3539bdbe-8e7f-45c0-a094-649d85d3adca"), "You can move your full Speed when you Sneak. You can use Swift Sneak while Burrowing, Climbing, Flying, or Swimming instead of Striding if you have the corresponding movement type.", 0 },
                    { new Guid("eedd663a-d431-476d-9125-5d45f19d4ec3"), 0, new Guid("a1804dfb-e3e0-45aa-b735-2f37fed15779"), "You can Demoralize with a mere glare. When you do, Demoralize loses the auditory trait and gains the visual trait, and you don’t take a penalty if the creature doesn’t understand your language.", 0 },
                    { new Guid("7b4e22c3-cf7d-4ab3-9d47-3bca57cd7ed6"), 0, new Guid("37e3bc29-be7b-4112-92aa-0b7dddbc2da3"), "You move more quickly on foot. Your Speed increases by 5 feet.", 0 },
                    { new Guid("4e989ca3-733a-4120-aa84-aaba3aa053f8"), 0, new Guid("ff4b4b20-73c2-4a67-a1a5-e504c8aa2dc6"), "You’re always sneaking unless you choose to be seen, even when there’s nowhere to hide. You can Hide and Sneak even without cover or being concealed. When you employ an exploration tactic other than Avoiding Notice, you also gain the benefits of Avoiding Notice unless you choose not to. See page 479 for more information about exploration tactics.", 0 },
                    { new Guid("6a59de26-a216-4f4f-b81f-094eb8998249"), 0, new Guid("174c21f8-b29a-4141-9070-eca5ecfdee71"), "You step carefully and quickly. You can Step into difficult terrain.", 0 },
                    { new Guid("3b09f3f6-9075-4013-9bd5-d674e3f00ffc"), 1, new Guid("2a59396f-bf2a-4075-8207-3c906b7624ff"), "If you’re legendary in Athletics, you gain a climb Speed equal to your Speed.", 0 },
                    { new Guid("4ebf2045-8b7f-4573-8f3b-af03c404638b"), 0, new Guid("17232376-8797-4f5b-bee0-2614d6938d5a"), "Your experience in navigating a certain type of terrain makes you supremely confident while doing so. You gain a +1 circumstance bonus to Survival checks in one of the following types of terrain, chosen when you select this feat: aquatic, arctic, desert, forest, mountain, plains, sky, swamp, or underground.", 0 },
                    { new Guid("f95849f0-3bba-430f-b44a-6828c1fbdbe9"), 0, new Guid("68a98dbf-4a45-4217-a94f-2d0969915d96"), "Your body quickly bounces back from afflictions. You regain twice as many Hit Points from resting. Each time you succeed at a Fortitude save against an ongoing disease or poison, you reduce its stage by 2, or by 1 against a virulent disease or poison. Each critical success you achieve against an ongoing disease or poison reduces its stage by 3, or by 2 against a virulent disease or poison. In addition, you reduce the severity of your drained condition by 2 when you rest for a night instead of by 1.", 0 },
                    { new Guid("3345970c-ae02-486b-a2ea-75eef371f9a4"), 0, new Guid("9415b689-43b4-4177-b861-32cab298b5fe"), "You can Subsist using Survival on different planes, even those without resources or natural phenomena you normally need. For instance, you can forage for food even if the plane lacks food that could normally sustain you. A success on your check to Subsist can also reduce the damage dealt by the plane, at the GM’s discretion.", 0 },
                    { new Guid("5983317e-3930-45c3-a5b2-d286fd3bf850"), 0, new Guid("8dc95af1-d049-457f-91f8-311ead81336d"), "You easily pick up new languages. You learn two new languages, chosen from common languages, uncommon languages, and any others you have access to. You learn an additional language if you are or become a master in Society and again if you are or become legendary.", 0 },
                    { new Guid("0589bdf3-abf3-4850-a9fe-5f8454150417"), 1, new Guid("d76bcd62-20d9-4fce-9fc1-735ec21a0cb2"), "If you’re an expert in Performance, you can fascinate up to four observers; if you’re a master, you can fascinate up to 10 observers; and if you’re legendary, you can fascinate any number of observers at the same time.", 0 },
                    { new Guid("32cdf8c4-ea19-43b2-8cf4-8b462fee385d"), 0, new Guid("8df39189-1886-4523-95b0-5980cad573f4"), "You Recognize Spells swiftly. Once per round, you can Recognize a Spell using a skill in which you’re a master as a free action.", 0 },
                    { new Guid("8a8dd86f-24fc-469c-b760-011217f25d3c"), 0, new Guid("045ae2b1-ef9d-44a3-898d-8feb0832b94c"), "You can frighten foes so much, they might die. Attempt an Intimidation check against the Will DC of a living creature within 30 feet of you that you sense or observe and who can sense or observe you. If the target can’t hear you or doesn’t understand the language you are speaking, you take a –4 circumstance penalty. The creature is temporarily immune for 1 minute.", 0 },
                    { new Guid("068516d5-9c17-490a-8f75-cf975420ca79"), 0, new Guid("c7443dbf-2f52-48df-a53c-8dd6ad6732c0"), "You can apply natural cures to heal your allies. You can use Nature instead of Medicine to Treat Wounds. If you’re in the wilderness, you might have easier access to fresh ingredients, allowing you to gain a +2 circumstance bonus to your check to Treat Wounds using Nature, subject to the GM’s determination.", 0 },
                    { new Guid("b95929b6-0cf7-4eb3-aa95-fa8f2f2c9ca0"), 0, new Guid("d76bcd62-20d9-4fce-9fc1-735ec21a0cb2"), "When you Perform, compare your result to the Will DC of one observer. If you succeed, the target is fascinated by you for 1 round. If the observer is in a situation that demands immediate attention, such as combat, you must critically succeed to fascinate it and the Perform action gains the incapacitation trait. You must choose which creature you’re trying to fascinate before you roll your check, and the target is then temporarily immune for 1 hour.", 0 },
                    { new Guid("2f35abd2-9e98-470e-a8a4-12ff83325793"), 0, new Guid("3bb4c8cd-9368-43dd-92b2-99174568570a"), "You can downplay the consequences or outrageousness of your requests using sheer brazenness and charm. When you Request something, you reduce any DC increases for making an outrageous request by 2, and if you roll a critical failure for your Request, you get a failure instead. While this means you can never cause your target to reduce their attitude toward you by making a Request, they eventually tire of requests, even though they still have a positive attitude toward you.", 0 },
                    { new Guid("0f984b03-0710-45ec-b3d2-8b79b3bad4d1"), 0, new Guid("7aded813-2325-4a4d-aea7-077680584823"), "You learn the sign languages associated with the languages you know, allowing you to sign and understand signs. Sign languages typically require both hands to convey more complex concepts, and they are visual rather than auditory.", 0 },
                    { new Guid("6f804bdb-e8ea-4b94-b8da-9dd428098588"), 1, new Guid("7aded813-2325-4a4d-aea7-077680584823"), "Sign language is difficult to understand during combat due to the level of attention needed, unlike basic gestures like pointing at a foe to suggest a target. Sign language is hard to use in areas of low visibility, just like speech is difficult in a noisy environment.", 0 },
                    { new Guid("0482965b-932e-407e-a445-337a78cb3eca"), 0, new Guid("ccdd4b23-9813-407e-a7a6-8bc2cdafbab5"), "When you Coerce, you can compare your Intimidation check result to the Will DCs of two targets instead of one. It’s possible to get a different degree of success for each target. The number of targets you can Coerce in a single action increases to four if you’re an expert, 10 if you’re a master, and 25 if you’re legendary.", 0 },
                    { new Guid("08b12c02-c83f-43de-be5c-dd9ec87334cf"), 0, new Guid("eda136b0-c9e5-4b60-abd3-cc534c043a00"), "You Swim 5 feet farther on a success and 10 feet farther on a critical success, to a maximum of your Speed. If you’re legendary in Athletics, you gain a swim Speed equal to your Speed.", 0 },
                    { new Guid("af297ffe-fd7d-42b4-93b4-05f79cc46251"), 0, new Guid("c041f814-94c4-43a1-be45-3bcd2621f2bb"), "You’ve discovered medical breakthroughs or techniques that achieve miraculous results. Once per day for each target, you can spend 1 hour treating that target and attempt a Medicine check to remove a disease or the blinded, deafened, doomed, or drained condition. Use the DC of the disease or of the spell or effect that created the condition. If the effect’s source is an artifact, above 20th level, or similarly powerful, increase the DC by 10.", 0 },
                    { new Guid("0edf9962-598d-4813-bdef-f310458b9ea6"), 0, new Guid("b5a95cad-67ab-4716-b582-4a11d8b863d1"), "You become trained in the skill of your choice.", 0 },
                    { new Guid("c92cea06-9c7d-43a4-906d-e532765fd3f2"), 0, new Guid("06f5008a-8b53-4c11-b0ec-2176e135d8b8"), "Your skill with languages and codes is so great that you can decipher information with little more than a quick read through a text. You can Decipher Writing using Society while reading at normal speed. If you slow down and spend the full amount of time that’s ordinarily required and roll a success, you get a critical success; if you critically succeed while spending the normal amount of time, you gain a nearly word-for-word understanding of the document.", 0 },
                    { new Guid("f3025adc-d289-42fc-b072-64fb3a523a45"), 0, new Guid("ca8d59e8-f938-4ffb-9890-9bed87134d5b"), "You know basic facts off the top of your head. Choose a skill you’re an expert in that has the Recall Knowledge action and for which you have the Assurance feat. You can use the Recall Knowledge action with that skill as a free action once per round. If you do, you must use Assurance on the skill check.", 0 },
                    { new Guid("7dd54aeb-9180-4509-ac60-9d9f31b4d9c9"), 0, new Guid("738f86de-6f73-4ffa-a790-abd8feeb43c5"), "When you Make an Impression, you can compare your Diplomacy check result to the Will DCs of two targets instead of one. It’s possible to get a different degree of success for each target. The number of targets increases to four if you’re an expert, 10 if you’re a master, and 25 if you’re legendary.", 0 },
                    { new Guid("1ed675fc-6c30-4ded-a479-961f8bdd3227"), 0, new Guid("e4c0f632-f086-40f7-81c4-2d54f1bcb5b9"), "Even in the worst circumstances, you can perform basic tasks. Choose a skill you’re trained in. You can forgo rolling a skill check for that skill to instead receive a result of 10 + your proficiency bonus (do not apply any other bonuses, penalties, or modifiers).", 0 },
                    { new Guid("c2f95e6a-d3ee-41a3-b9c5-2ce52b87cb28"), 0, new Guid("d466988f-8d00-4230-ab88-5c963abbecd1"), "You elude and evade attempts to uncover your true nature or intentions. When a spell or magical effect tries to read your mind, detect whether you are lying, or reveal your alignment, you can attempt a Deception check against the spell or effect’s DC. If you succeed, the effect reveals nothing.", 0 },
                    { new Guid("b916a391-2032-4ec4-b914-f40d36019fa8"), 0, new Guid("18e0c385-d2ba-4646-989d-2e49d43d5f36"), "You can carry more than your frame implies. Increase your maximum and encumbered Bulk limits by 2.", 0 },
                    { new Guid("be06ab53-d3f3-48bd-95b0-e5ed0ef51451"), 0, new Guid("5803b272-2368-49ce-ba0b-8c97aa753885"), "You can negotiate incredibly quickly in adverse situations. You attempt to Make an Impression and then Request your opponent cease their current activity and engage in negotiations. You take a –5 penalty to your Diplomacy check. The GM sets the DC of the Request based on the circumstances—it’s generally at least a very hard DC of the creature’s level. Some creatures might simply refuse, and even those who agree to parley might ultimately find your arguments lacking and return to violence.", 0 },
                    { new Guid("23d9c608-82be-4500-8430-ece2f345a971"), 0, new Guid("c8dd98a8-e102-4751-9606-88ed457bfdeb"), "You are a genius at Crafting, easily able to determine how things are made and create new inventions. You can spend downtime to invent a common formula that you don’t know. This works just like the Craft activity: you spend half the Price of the formula up front, attempt a Crafting check, and on a success either finish the formula by paying the difference or work for longer to decrease the Price. The difference is that you spend the additional time in research, design, and development, rather than in creating an item. Once it’s complete, you add the new formula you invented to your formula book.", 0 },
                    { new Guid("947e2872-b7c3-4255-839d-6bde545f65e7"), 0, new Guid("f552a716-9e47-457c-a9ec-51fa8cd3a85d"), "You have a sense for spells that twist minds or reveal secrets. You gain a +2 circumstance bonus to Occultism checks to Identify Magic with the mental, possession, prediction, or scrying traits.", 0 },
                    { new Guid("46646590-2516-4adb-9ae5-7c050520e480"), 0, new Guid("6684d89b-1994-4fa9-8b6b-c5123b642e86"), "You can Earn Income (page 236) using Diplomacy, spending your days hunting for bargains and reselling at a profit. You can also spend time specifically sniffing out a great bargain on an item; this works as if you were using Earn Income with Diplomacy, except instead of gaining money, you purchase the item at a discount equal to the money you would have gained, gaining the item for free if your earned income equals or exceeds its cost. Finally, if you select Bargain Hunter during character creation at 1st level, you start play with an additional 2 gp.", 0 },
                    { new Guid("600a8c6c-ad12-4e0c-b656-70f740cce02e"), 0, new Guid("73d6b44a-a2a6-4a70-be2c-2dd59c09657a"), "You easily pull yourself onto ledges. When you Grab an Edge, you can pull yourself onto that surface and stand. You can use Athletics instead of a Reflex save to Grab an Edge.", 0 },
                    { new Guid("81d98c13-816a-41c5-9d33-476397d08dc7"), 2, new Guid("219b84b9-cb31-44df-b37e-6bf4916e5dfb"), "If you activate a magic item that requires a spell attack roll or spell DC and you don’t have the ability to cast spells of the relevant tradition, use your level as your proficiency bonus and the highest of your Intelligence, Wisdom, or Charisma modifiers. If you’re a master in the appropriate skill for the item’s tradition, you instead use the trained proficiency bonus, and if you’re legendary, you instead use the expert proficiency bonus.", 0 },
                    { new Guid("6cd9c0c0-51e4-4c37-96d7-a7c861812b8e"), 1, new Guid("219b84b9-cb31-44df-b37e-6bf4916e5dfb"), "Attempt a check using the skill matching the item’s magic tradition, or matching a tradition that has the spell on its list, if you’re trying to cast a spell from the item. The relevant skills are Arcana for arcane, Nature for primal, Occultism for occult, Religion for divine, or any of the four for an item that has the magical trait and not a tradition trait. The GM determines the DC based on the item’s level (possibly adjusted depending on the item or situation).", 0 },
                    { new Guid("11d84471-94ee-4c1e-a67e-07c3ad92966e"), 0, new Guid("219b84b9-cb31-44df-b37e-6bf4916e5dfb"), "You examine a magic item you normally couldn’t use in an effort to fool it and activate it temporarily. For example, this might allow a fighter to cast a spell from a wand or allow a wizard to cast a spell that’s not on the arcane list using a scroll. You must know what activating the item does, or you can’t attempt to trick it.", 0 },
                    { new Guid("19cd7955-cd5b-4133-8967-48d9f9379ef4"), 0, new Guid("b1c71e21-bea7-453b-b23a-13ecc1b3675b"), "In situations where you can physically menace the target when you Coerce or Demoralize, you gain a +1 circumstance bonus to your Intimidation check and you ignore the penalty for not sharing a language. If your Strength score is 20 or higher and you are a master in Intimidation, this bonus increases to +2.", 0 },
                    { new Guid("3437ee0d-8348-4ee0-b08f-7cb793843223"), 1, new Guid("b1c71e21-bea7-453b-b23a-13ecc1b3675b"), "If it’s unclear whether the specialty applies, the GM decides. Some specialties might apply only partially. For example, if you were making a morningstar and had specialty in woodworking, the GM might give you half your bonus because the item requires both blacksmithing and woodworking.", 0 },
                    { new Guid("d0c298c6-63be-431c-80e9-5a95ec712f73"), 0, new Guid("6f59e2f4-2100-436d-8cf8-266585faa937"), "First impressions are your strong suit. When you meet someone in a casual or social situation, you can immediately attempt a Diplomacy check to Make an Impression on that creature rather than needing to converse for 1 minute. You take a –5 penalty to the check. If you fail or critically fail, you can engage in 1 minute of conversation and attempt a new check at the end of that time rather than accepting the failure or critical failure result.", 0 },
                    { new Guid("e0ff07c3-5e1e-4258-8e85-c1255b47705e"), 0, new Guid("4f6b0041-df64-4d81-9ddd-baebcfdd28ed"), "You stand up. This movement doesn’t trigger reactions.", 0 },
                    { new Guid("be009048-9abe-439f-97f1-d78289d9752c"), 0, new Guid("7ba0d3ef-7d44-42e4-8e2d-0b8bce8c9d16"), "You can keep your balance easily, even in adverse conditions. Whenever you roll a success using the Balance action, you get a critical success instead. You’re not flat-footed while attempting to Balance on narrow surfaces and uneven ground. Thanks to your incredible balance, you can attempt an Acrobatics check instead of a Reflex save to Grab an Edge.", 0 },
                    { new Guid("13825e71-f1db-4f44-9ec8-3bdf31a04712"), 0, new Guid("d1d5b37b-2fcd-4699-892f-5c81cc437323"), "You spend time teaching an animal to do a certain action. You can either select a basic action the animal already knows how to do (typically those listed in the Command an Animal action on page 249) or attempt to teach the animal a new basic action. The GM determines the DC of any check required and the amount of time the training takes (usually at least a week). It’s usually impossible to teach an animal a trick that uses critical thinking. If you’re expert, master, or legendary in Nature, you might be able to train more unusual creatures, at the GM’s discretion.", 0 },
                    { new Guid("447bc70f-fd26-40a6-8663-02d4ccb6c686"), 0, new Guid("57442d19-cae2-465c-9d3d-2e77ecde2a50"), "Your knowledge has expanded to encompass a new field. Choose an additional Lore skill subcategory. You become trained in it. At 3rd, 7th, and 15th levels, you gain an additional skill increase you can apply only to the chosen Lore subcategory.", 0 },
                    { new Guid("30714efb-c8ad-4874-a32a-a5361cbe1924"), 0, new Guid("12456924-12d6-4f6e-bde1-100892c683b5"), "Your fame has spread throughout the lands. NPCs who succeed at a DC 10 Society check to Recall Knowledge have heard of you and usually have an attitude toward you one step better than normal, depending on your reputation and the NPC’s disposition. For instance, if you’re well-known for cruel and demanding behavior, creatures might be intimidated by you, rather than be friendly toward you. When you Earn Income with Performance, you attract higher-level audiences than your location would allow, as audiences flock to see you. For instance, rulers and angels might travel to your small tower in the woods to hear you perform. Typically, this increases the audiences available by 2 levels or more, determined by the GM.", 0 },
                    { new Guid("b49e4a7d-a147-40c2-a552-b71770e29367"), 0, new Guid("7de0d323-fc78-4154-a4d0-91e8af5ef631"), "You know about life on the streets and feel the pulse of your local settlement. You can use your Society modifier instead of your Diplomacy modifier to Gather Information. In any settlement you frequent regularly, you can use the Recall Knowledge action with Society to know the same sorts of information that you could discover with Diplomacy to Gather Information. The DC is usually significantly higher, but you know the information without spending time gathering it. If you fail to recall the information, you can still subsequently attempt to Gather Information normally.", 0 },
                    { new Guid("ab3c5f8b-1cea-4981-b30d-fc1d811fc593"), 0, new Guid("2b952cb7-5972-4866-a8d3-92410b2ed759"), "You can use the Craft activity to create snares, using the rules from page 244. When you select this feat, you add the formulas for four common snares to your formula book.", 0 },
                    { new Guid("497171c0-318e-4491-b527-ce421ee5ab7f"), 0, new Guid("2a59396f-bf2a-4075-8207-3c906b7624ff"), "When Climbing, you move 5 more feet on a success and 10 more feet on a critical success, to a maximum of your Speed.", 0 },
                    { new Guid("310c2c54-d5b7-408f-81c4-4465fcd9b9f2"), 0, new Guid("288c9224-1ffe-4acc-8343-ba9a40e76c38"), "Select one type of difficult terrain from the following list: rubble, snow, or underbrush. While undetected by all non-allies in that type of terrain, you can Sneak without attempting a Stealth check as long as you move no more than 5 feet and do not move within 10 feet of an enemy at any point during your movement. This also allows you to automatically approach creatures to within 15 feet while Avoiding Notice during exploration as long as they aren’t actively Searching or on guard.", 0 },
                    { new Guid("7be3eec5-5c9b-4f76-b412-3bec0c802dd6"), 0, new Guid("9b475bb4-2086-4f81-b4ab-ef3f8f09f5db"), "You have an incredible ability to invest more magic items. Increase your limit on invested items from 10 to 12.", 0 },
                    { new Guid("98b0a02f-62cf-4fd1-bfc1-674b17c90563"), 0, new Guid("8ee11526-08b4-451e-8424-83704f0d1a70"), "You have exceptional talent with one type of performance. You gain a +1 circumstance bonus when making a certain type of performance. If you are a master in Performance, this bonus increases to +2. Select one of the following specialties and apply the bonus when attempting Performance checks of that type. If it’s unclear whether the specialty applies, the GM decides.", 0 },
                    { new Guid("2d1ff363-b4d4-43e3-910c-dac144202e6d"), 0, new Guid("1332e046-d8ea-4a33-9a07-69308317891c"), "You can use Deception to weave traps to trip up anyone trying to deceive you. If you can engage in conversation with someone trying to Lie to you, use your Deception DC if it is higher than your Perception DC to determine whether they succeed. This doesn’t apply if you don’t have a back-and-forth dialogue, such as when someone attempts to Lie during a long speech.", 0 },
                    { new Guid("550d9521-8aa7-45c5-85f0-0d3871077f8d"), 0, new Guid("43f75824-0d49-466f-aa58-e40046c4a6d4"), "You are skilled at learning information through conversation. The Gather Information exploration activity takes you half as long as normal (typically reducing the time to 1 hour). If you’re a master in Diplomacy and you Gather Information at the normal speed, when you attempt to do so and roll a critical failure, you get a failure instead. There is still no guarantee that a rumor you learn with Gather Information is accurate.", 0 },
                    { new Guid("8327dfe8-9bc4-40ab-8459-51ce05d11517"), 0, new Guid("a38f19f2-3b2d-4907-8425-d71dc351e8df"), "You have social connections you can leverage to trade favors or meet important people. When you’re in an area with connections (typically a settlement where you’ve spent downtime building connections, or possibly another area in the same nation), you can attempt a Society check to arrange a meeting with an important political figure or ask for a favor in exchange for a later favor of your contact’s choice. The GM decides the DC based on the difficulty of the favor and the figure’s prominence.", 0 },
                    { new Guid("8bae76df-a77a-4fb2-a16f-81864f06e55d"), 0, new Guid("76a68ae1-d7e0-4b2a-af54-4978b06db5cb"), "You can use your momentum from a jump to propel yourself off a wall. If you’re adjacent to a wall at the end of a jump (whether performing a High Jump, Long Jump, or Leap), you don’t fall as long as your next action is another jump. Furthermore, since your previous jump gives you momentum, you can use High Jump or Long Jump as a single action, but you don’t get to Stride as part of the activity.", 0 },
                    { new Guid("2c4b8bac-89f1-45f3-a60a-c6dfbbb00ea1"), 1, new Guid("76a68ae1-d7e0-4b2a-af54-4978b06db5cb"), "You can use Wall Jump only once in a turn, unless you’re legendary in Athletics, in which case you can use Wall Jump as many times as you can use consecutive jump actions in that turn.", 0 },
                    { new Guid("8c4e02b6-3966-491d-a8e8-aa05e8f6c0cb"), 0, new Guid("2c8b47a4-eb56-491b-82fd-a3f894282025"), "Your knowledge has expanded to encompass a new field. Choose an additional Lore skill subcategory. You become trained in it. At 3rd, 7th, and 15th levels, you gain an additional skill increase you can apply only to the chosen Lore subcategory.", 0 },
                    { new Guid("2084aa10-37e6-4665-b379-32a1c378e09e"), 0, new Guid("38b0c4f7-2ad6-4c04-928d-dc53f2ff39b7"), "Even when caught in falsehoods, you pile lie upon lie. Reduce the circumstance bonus a target gains for your previous attempts to Create a Diversion or Lie to it from +4 to +2. If you’re a master in Deception, reduce the bonus to +1, and if you’re legendary, your targets don’t get these bonuses at all.", 0 },
                    { new Guid("fe9c688e-04a1-4e87-bfea-ad1d9224efd5"), 0, new Guid("ad4fe73a-0518-46c1-bfee-130d1b2053ab"), "You can read lips of others nearby who you can clearly see. When you’re at your leisure, you can do this automatically. In encounter mode or when attempting a more difficult feat of lipreading, you’re fascinated and flat-footed during each round in which you focus on lip movements, and you must succeed at a Society check (DC determined by the GM) to successfully read someone’s lips. In either case, the language read must be one that you know.", 0 },
                    { new Guid("c30bef55-a24b-4a39-99ef-0e0bd895355a"), 0, new Guid("24bfd707-04bb-4464-a3ad-e1dd040c0377"), "When you Leap, you can jump 5 feet up with a vertical Leap, and you increase the distance you can jump horizontally by 5 feet.", 0 },
                    { new Guid("c2d3b438-cbb4-43c2-88c1-3903570434c4"), 0, new Guid("269b8813-ba84-42c6-9b73-11de579797bb"), "Your techniques allow you to fight as you climb. You’re not flat-footed while Climbing and can Climb with a hand occupied. You must still use another hand and both legs to Climb.", 0 },
                    { new Guid("8156a63f-dd8b-45e7-af35-fc4e6552a587"), 0, new Guid("b5d31ebb-d361-4780-93c5-324bfd3c39b8"), "You’ve studied in large medical wards, treating several patients at once and tending to all their needs. When you use Treat Disease or Treat Wounds, you can treat up to two targets. If you’re a master in Medicine, you can treat up to four targets, and if you’re legendary, you can treat up to eight targets.", 0 },
                    { new Guid("6156f6a0-8ca3-4260-aa1c-8842c9a6d780"), 0, new Guid("3afb7bd6-f0c2-4187-9d47-f7a06d512fd3"), "You’re so skilled with languages you can create a pidgin instantly. You can always talk to any creature that has a language—even a language you don’t know —by creating a new pidgin language that uses simplified terms and conveys basic concepts. To do so, you must first understand at least what medium of communication the creature uses (speech, sign language, and so on).", 0 },
                    { new Guid("52ea6d08-fd50-45a1-8ee9-2dca70178979"), 0, new Guid("53bda5e8-f9d2-461f-9495-c9db35ab99c1"), "Learning spells comes easily to you. If you’re an expert in a tradition’s associated skill, you take 10 minutes per spell level to learn a spell of that tradition, rather than 1 hour per spell level. If you fail to learn the spell, you can try again after 1 week or after you gain a level, whichever comes first. If you’re a master in the tradition’s associated skill, learning a spell takes 5 minutes per spell level, and if you’re legendary, it takes 1 minute per spell level. You can use downtime to learn and inscribe new spells. This works as if you were using Earn Income with the tradition’s associated skill, but instead of gaining money, you choose a spell available to you to learn and gain a discount on learning it, learning it for free if your earned income equals or exceeds its cost.", 0 },
                    { new Guid("8667db8e-760b-4b1d-a0b1-559e02a22b15"), 0, new Guid("a90aba98-98fe-4a4d-86a6-93025e5d558a"), "You can Craft magic items, though some have other requirements, as listed in Chapter 11. When you select this feat, you gain formulas for four common magic items of 2nd level or lower.", 0 },
                    { new Guid("70b38a25-db58-44a1-8785-a7124775e352"), 0, new Guid("9ab4e3c9-f592-4c0d-ac6e-adb33651feca"), "You unparalleled athletic skill allows you to jump impossible distances. Triple the distance you Long Jump (so you could jump 60 feet on a successful DC 20 check). When you High Jump, use the calculation for a Long Jump but don’t triple the distance.", 0 },
                    { new Guid("605cae2e-9971-44ec-9fe2-9df99dd6fa87"), 0, new Guid("8a71ca0e-0c73-4fdd-bde7-431f3237bca6"), "You Squeeze 5 feet per round (10 feet on a critical success). If you’re legendary in Acrobatics, you Squeeze at full Speed.", 0 },
                    { new Guid("73719d8e-db64-463a-99f2-c30bc4c50bab"), 0, new Guid("52456558-ce51-4f42-8ff2-fd4dbb72c25d"), "If you trigger a device or set off a trap while disarming it, you gain a +2 circumstance bonus to your AC or saving throw against the device or trap. This applies only to attacks or effects triggered by your failed attempt, not to any later ones, such as additional attacks from a complex trap.", 0 },
                    { new Guid("72e1ef9e-b124-40eb-b185-e1f6199d6c77"), 0, new Guid("a6def9d1-3dd5-4d2f-8e75-1773753119d9"), "Your study of magic allows you to instinctively sense its presence. You can cast 1st-level detect magic at will as an arcane innate spell. If you’re a master in Arcana, the spell is heightened to 3rd level; if you’re legendary, it is heightened to 4th level.", 0 },
                    { new Guid("d7fb4179-4b97-4759-8a00-3984bdb91602"), 0, new Guid("43ae43aa-11d2-420f-bf17-6978f8a45a0f"), "Your charm allows you to win over those you lie to. When you get a critical success using the Lie action, the target’s attitude toward you improves by one step, as though you’d succeeded at using Diplomacy to Make an Impression. This works only once per conversation, and if you critically succeed against multiple targets using the same result, you choose one creature’s attitude to improve. You must be lying to impart seemingly important information, inflate your status, or ingratiate yourself, which trivial or irrelevant lies can’t achieve.", 0 },
                    { new Guid("485c9894-7bac-4b39-a277-004d316976ae"), 0, new Guid("8b9edbcc-05ce-4df7-bc51-910ff6be643d"), "You become trained in all simple weapons. If you were already trained in all simple weapons, you become trained in all martial weapons. If you were already trained in all martial weapons, you become trained in one advanced weapon of your choice.", 0 }
                });

            migrationBuilder.InsertData(
                table: "Feats_Details",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("1e6015e9-a70f-4e85-810c-bbe811bd477d"), 0, new Guid("9c848549-edaa-49b9-aa64-fcea1ccbc966"), "Your catlike aerial acrobatics allow you to cushion your falls. Treat falls as 10 feet shorter. If you’re an expert in Acrobatics, treat falls as 25 feet shorter. If you’re a master in Acrobatics, treat them as 50 feet shorter. If you’re legendary in Acrobatics, you always land on your feet and don’t take damage, regardless of the distance of the fall.", 0 },
                    { new Guid("9ac62ad5-c1ab-46ae-8e36-403268396a6e"), 0, new Guid("064690bd-cd97-47a5-9e4c-fb8672bb6225"), "You can set up a disguise in half the usual time (generally 5 minutes). If you’re a master, it takes one-tenth the usual time (usually 1 minute). If you’re legendary, you can create a full disguise and Impersonate as a 3-action activity.", 0 },
                    { new Guid("db6f1680-f693-4b5c-9dae-16516d0bd65a"), 0, new Guid("1d6f005c-1b19-4072-8609-62af32b427e2"), "Whether through instinct, study, or magic, you feel a deeper connection to your ancestry.You gain a 1st - level ancestry feat.", 0 },
                    { new Guid("9f69671b-1e75-49a2-b6a8-d418bbf60f3f"), 0, new Guid("85740fcc-7aaf-494f-81d7-8360620977d1"), "Your avoidance or observation is beyond the ken of most in your profession. Choose Fortitude saves, Reflex saves, Will saves, or Perception. You become an expert in your choice. At 17th level, you become a master in your choice.", 0 },
                    { new Guid("5cdf024f-58b7-4b4b-9170-a8b758d94618"), 0, new Guid("7e3b8e25-d2ad-400e-9b03-a4993d0e5f8b"), "You can Identify Magic swiftly. You take only 1 minute when using Identify Magic to determine the properties of an item, ongoing effect, or location, rather than 10 minutes. If you’re a master, it takes a 3-action activity, and if you’re legendary, it takes 1 action.", 0 },
                    { new Guid("5b465363-62e4-41bb-a073-96f9423c8c4e"), 0, new Guid("2107ba8d-4766-4434-b23e-fe90d9837b02"), "You learned folk medicine to help recover from diseases and poison, and using it diligently has made you especially resilient. When you Treat a Disease or a Poison, or someone else uses one of these actions on you, increase the circumstance bonus granted on a success to +4, and if the result of the patient’s saving throw is a success, the patient gets a critical success.", 0 },
                    { new Guid("0b8ded86-03cd-412f-a306-67aead75c577"), 0, new Guid("0422a543-ec8f-4c04-9e15-5b4fd5c1f065"), "You forge strong connections with animals. You can spend 7 days of downtime regularly interacting with a normal animal (not a companion or other special animal) that is friendly or helpful to you. After this duration, attempt a DC 20 Nature check. If successful, you bond with the animal. The animal is permanently helpful to you, unless you do something egregious to break your bond. A helpful animal is easier to direct, as described under Command an Animal on page 249. Bonding with a new animal ends any previous bond you had. You can’t have both a bonded animal and an animal companion (though you can have both a bonded animal and a familiar).", 0 },
                    { new Guid("98e7f9c9-8027-485d-af27-2de34ee1e1da"), 1, new Guid("9ab4e3c9-f592-4c0d-ac6e-adb33651feca"), "You can jump a distance greater than your Speed by spending additional actions when you Long Jump or High Jump. For each additional action spent, add your Speed to the limit on how far you can Leap.", 0 },
                    { new Guid("4ca461d1-0a65-42e2-8171-d30269bccf2c"), 0, new Guid("1acd1549-a4de-477d-a3f4-e862c04c8a7a"), "You can draw upon strange variations in your spellcasting, whether or not you can cast occult spells. The DCs to Recognize Spells you cast and Identify Magic you use increase by 5.", 0 },
                    { new Guid("ffef847d-bf3b-4b80-9e63-3a2d6714deea"), 0, new Guid("059f1e6a-f8cd-4be2-8024-ddc21dd7cd60"), "You zealously monitor a patient’s progress to administer treatment faster. When you Treat Wounds, your patient becomes immune for only 10 minutes instead of 1 hour. This applies only to your Treat Wounds activities, not any other the patient receives.", 0 },
                    { new Guid("eb92aacb-50c4-49d2-8ed0-71860ad8582e"), 0, new Guid("9648e97f-800c-492f-9277-93a17174bab1"), "You’ve learned how to handle situations when you’re out of your depth. Your proficiency bonus to untrained skill checks is equal to half your level instead of +0. If you’re 7th level or higher, the bonus increases to your full level instead. This doesn’t allow you to use the skill’s trained actions.", 0 },
                    { new Guid("1c266490-9c64-4913-a6bf-5b9ff4d37a9c"), 0, new Guid("a64ac93e-e7c5-46d1-85ec-72d93d5dcf7a"), "Tracking is second nature to you, and when necessary you can follow a trail without pause. You can Track while moving at full Speed by taking a –5 penalty to your Survival check. If you’re a master in Survival, you don’t take the –5 penalty. If you’re legendary in Survival, you no longer need to roll a new Survival check every hour when tracking, though you still need to roll whenever there are significant changes in the trail.", 0 },
                    { new Guid("5a2ebba7-943f-4b48-87e7-23a5bd5891a4"), 0, new Guid("8ee83a83-4763-4423-87ff-c12ef752a494"), "When you Command an Animal you’re mounted on to take a move action (such as Stride), you automatically succeed instead of needing to attempt a check. Any animal you’re mounted on acts on your turn, like a minion. If you Mount an animal in the middle of an encounter, it skips its next turn and then acts on your next turn. Page 249 has more on Command an Animal.", 0 },
                    { new Guid("d8f33acf-ba7f-4aec-a5e0-962dd317b1f8"), 0, new Guid("064e540b-673f-4abb-bacc-fda48911b21a"), "When you critically succeed at the Demoralize action, if the target’s level is lower than yours, the target is fleeing for 1 round.", 0 },
                    { new Guid("0b11531a-68c6-4cd9-a7f9-e4f3494f4ab3"), 0, new Guid("fa30f639-b913-4050-b7bc-a8e9991178f1"), "You often smuggle things past the authorities. When the GM rolls your Stealth check to see if a passive observer notices a small item you have concealed, the GM uses the number rolled or 10—whichever is higher—as the result of your die roll, adding it to your Stealth modifier to determine your Stealth check result. If you’re a master in Stealth, the GM uses the number rolled or 15, and if you’re legendary in Stealth, you automatically succeed at hiding a small concealed item from passive observers. This provides no benefits when a creature attempts a Perception check while actively searching you for hidden items. Due to your smuggling skill, you’re more likely to find more lucrative smuggling jobs when using Underworld Lore to Earn Income", 0 },
                    { new Guid("308d6b71-ee1c-4e7b-b3b5-1ef198b64205"), 0, new Guid("d264d400-645f-4e7e-8100-ae5b2caf9e0e"), "You can survive indefinitely without food or water and can endure severe, extreme, and incredible cold and heat without taking damage from doing so.", 0 },
                    { new Guid("60f7edf8-b1cd-4a3b-b412-af7a4b880942"), 0, new Guid("6db67ca1-3fef-4705-9ad3-4d0e121e943b"), "You can patch up wounds, even in combat. Attempt a Medicine check with the same DC as for Treat Wounds and restore the corresponding amount of HP; this doesn’t remove the wounded condition. As with Treat Wounds, you can attempt checks against higher DCs if you have the minimum proficiency rank. The target is then temporarily immune to your Battle Medicine for 1 day.", 0 },
                    { new Guid("5ca60765-3953-40b6-8d4a-0532b2e4c80d"), 0, new Guid("0e715099-8cfd-449b-a6b0-37467f68accc"), "You carefully safeguard your professional endeavors to prevent disaster. When you use Lore to Earn Income, if you roll a critical failure, you instead get a failure. If you’re an expert in Lore, you gain twice as much income from a failed check to Earn Income, unless it was originally a critical failure.", 0 },
                    { new Guid("180ac1bb-e6ae-4d53-b33a-71978026a8e5"), 0, new Guid("6f87700e-7194-47d6-a9b2-20e0e2e53482"), "Your performances inspire admiration and win you fans. You can Make an Impression using Performance instead of Diplomacy.", 0 },
                    { new Guid("0a652425-e8de-4a6d-83e8-523505d4f747"), 0, new Guid("fee17526-90f5-401c-bdec-d084f40852a7"), "You can attempt to Disarm, Grapple, Shove, or Trip creatures up to two sizes larger than you, or up to three sizes larger than you if you’re legendary in Athletics.", 0 },
                    { new Guid("7e74f923-5877-4e70-b996-be37b21a8fbc"), 0, new Guid("f3cdc428-01a4-4687-8d48-8de530cbd154"), "You can Pick a Lock using 1 action instead of 2.", 0 },
                    { new Guid("fd638442-dba6-4c64-a978-6076c474ffa1"), 0, new Guid("dbd06473-8700-438f-b4e1-35474b87171c"), "You have a system that lets you search at great speed, finding details and secrets twice as quickly as others can. When Searching, you take half as long as usual to Search a given area. This means that while exploring, you double the Speed you can move while ensuring you’ve Searched an area before walking into it (up to half your Speed). If you’re legendary in Perception, you instead Search areas four times as quickly.", 0 },
                    { new Guid("76c25d32-da2f-4db2-af66-56b8b3542db9"), 0, new Guid("5fec7506-9390-4455-83ed-fc3666ca4fa2"), "You can withstand more punishment than most before succumbing. Increase your maximum Hit Points by your level. You reduce the DC of recovery checks by 1 (page 459).", 0 },
                    { new Guid("96d02376-bd63-4d35-92f0-08c08ca9f2ca"), 0, new Guid("384659b6-1c1c-4612-9727-2d8406c2a328"), "You become trained in light armor. If you already were trained in light armor, you gain training in medium armor. If you were trained in both, you become trained in heavy armor.", 0 },
                    { new Guid("28d7b87a-55a3-48f3-9071-ab3e1600f129"), 0, new Guid("fffc0274-b5cd-428f-8144-a7d8b01f5986"), "You’re a treasure trove of information, but not all of it comes from reputable sources. When you fail (but don’t critically fail) a Recall Knowledge check using any skill, you learn a bit of true knowledge and a bit of erroneous knowledge, but you don’t have any way to differentiate which is which.", 0 },
                    { new Guid("614b8596-39fa-4006-903f-355857fc1e2d"), 0, new Guid("df3e0135-e1de-4b1f-a580-19f521c5f328"), "You can Crawl incredibly swiftly—up to half your Speed, rather than 5 feet. If you’re a master in Acrobatics, you can Crawl at full Speed, and if you’re legendary, you aren’t flat-footed while prone.", 0 },
                    { new Guid("9dfdb9a4-49d8-41a6-a8ac-2ea5e9e4626c"), 0, new Guid("9ee79ba9-47ac-4cf5-906d-9e88190e8d22"), "Your ability to Steal defies belief. You can attempt to Steal something that is actively wielded or that would be extremely noticeable or time consuming to remove (like worn shoes or armor). You must do so slowly and carefully, spending at least 1 minute (and significantly longer for items that are normally time consuming to remove, like armor). Throughout this duration you must have some means of staying hidden, such as the cover of darkness or a bustling crowd. You take a –5 penalty to your Thievery check. Even if you succeed, if the item is extremely prominent—like a suit of full plate armor—onlookers will quickly notice it’s gone after you steal it.", 0 },
                    { new Guid("38b5844d-0409-48fd-ab87-07bbe0e02f68"), 0, new Guid("5c26de36-847d-4a16-8871-0a2016fdfacc"), "You were raised among the nobility or have learned proper etiquette and bearing, allowing you to present yourself as a noble and play games of influence and politics. You can use Society to Make an Impression on a noble, as well as with Impersonate to pretend to be a noble if you aren’t one. If you want to impersonate a specific noble, you still need to use Deception to Impersonate normally, and to Lie when necessary.", 0 },
                    { new Guid("c479e6b3-e61e-4e45-8b4e-7375df616325"), 0, new Guid("8bfbc2e3-87d6-480d-8fd7-baeb77e465cd"), "When you critically succeed to Create a Diversion, you continue to remain hidden after the end of your turn. This effect lasts for an amount of time that depends on the diversion and situation, as determined by the GM (minimum 1 additional round).", 0 },
                    { new Guid("95e082e4-1262-4fa5-8937-a0bf794053eb"), 0, new Guid("eb5ca078-b3f2-4e84-8df4-526ced138637"), "You never get information about your areas of expertise wrong. When you Recall Knowledge using any Lore subcategory in which you’re trained, if you roll a critical failure, you get a failure instead. If you’re a master in a Lore subcategory, on a critical success, you gain even more information or context than usual.", 0 },
                    { new Guid("6b5087c0-7e76-445c-966e-7a50f572448f"), 0, new Guid("89921651-065e-48f8-98cb-c9b6cf6c71e9"), "You craft flawless creations with great efficiency. Whenever you roll a success at a Crafting check to make an item of the type you chose with Specialty Crafting, you get a critical success instead.", 0 },
                    { new Guid("c729dd0c-a2bf-44f0-9d2a-7ff744c09b26"), 0, new Guid("2fbc54de-6f02-49d5-a01c-6adfd732a81e"), "You can find ways to craft just about anything, despite restrictions. As long as you have the appropriate Crafting skill feat (such as Magical Crafting for magic items) and meet the item’s level and proficiency requirement, you ignore just about any other requirement, such as being of a specific ancestry or providing spells. The only exceptions are requirements that add to the item’s cost, including castings of spells that themselves have a cost, and requirements of special items such as the philosopher’s stone that have exclusive means of access and Crafting. The GM decides whether you can ignore a requirement.", 0 },
                    { new Guid("a23693cb-3840-48a8-94fb-7f93f6d118b6"), 0, new Guid("b8193a38-a31c-45f2-a715-2542f09b97ca"), "You’re fully immersed in another ancestry’s culture and traditions, whether born into them, earned through rite of passage, or bonded through a deep friendship or romance. Choose a common ancestry. You can select ancestry feats from the ancestry you chose, in addition to your character’s own ancestry, as long as the ancestry feats don’t require any physiological feature that you lack, as determined by the GM.", 0 },
                    { new Guid("79f8ff8b-a14d-4621-ab56-df66be388a38"), 0, new Guid("48c371fb-6e9c-4d4f-965d-d56694b52100"), "You take 1 minute to Repair an item. If you’re a master in Crafting, it takes 3 actions. If you’re legendary, it takes 1 action.", 0 },
                    { new Guid("49a1d867-7420-4c1d-9c70-3b36f83adf22"), 0, new Guid("15ccc079-da12-4678-8b48-f626e51418df"), "It takes more to kill you than most. You die from the dying condition at dying 5, rather than dying 4.", 0 },
                    { new Guid("c53778be-16f6-4284-9f86-328a4191a823"), 0, new Guid("ce1dc7c1-c529-42a2-a2f5-f6ca99df1804"), "You’ve started to make a meaningful connection about the common underpinnings of the four traditions of magic and magical essences, allowing you to understand them all through an arcane lens. Whenever you use a skill action or a skill feat that requires a Nature, Occultism, or Religion check, depending on the magic tradition, you can use Arcana instead. If you would normally take a penalty or have a higher DC for using Arcana on other magic (such as when using Identify Magic), you no longer do so.", 0 },
                    { new Guid("44cfef57-7ea2-4289-bab1-9721399c2190"), 0, new Guid("3d690c93-0e1b-42c8-9d62-4e4219729dec"), "You react more quickly than others can. You gain a +2 circumstance bonus to initiative rolls.", 0 },
                    { new Guid("538628da-6b39-455a-919a-7b2d8de5ff61"), 0, new Guid("17f35e0f-3778-4143-b516-d08faf79bc68"), "You’re so immersed in divine scripture that you find meaning and guidance in your texts in any situation. Spend 10 minutes Deciphering Writing on religious scriptures of your deity or philosophy while thinking about a particular problem or conundrum you face, and then attempt a Religion check (DC determined by the GM). If you succeed, you unearth a relevant passage, parable, or aphorism that can help you move forward or change your thinking to help solve your conundrum. For example, the GM might provide you with a cryptic poem or hint that can guide you to the next step of solving your problem.", 0 },
                    { new Guid("e32321a9-80fd-4f59-939d-9a0dd3c98862"), 0, new Guid("7586b528-bef3-41be-b1f0-ea1fcb958c88"), "You can use High Jump and Long Jump as a single action instead of 2 actions. If you do, you don’t perform the initial Stride (nor do you fail if you don’t Stride 10 feet).", 0 },
                    { new Guid("55213e09-5320-4baa-9324-35e22eb06496"), 0, new Guid("dfb5e49e-df3e-443e-bfbf-d41e042306ed"), "You’ve learned to fight underwater. You are not flat-footed while in water, and you don’t take the usual penalties for using a bludgeoning or slashing melee weapon in water.", 0 },
                    { new Guid("f1ce54f4-d426-4acf-bda9-645a50a04a01"), 0, new Guid("37f7d759-3c83-491a-a516-b41b64cf57a7"), "When you successfully Coerce someone, the maximum time they comply increases to a week, still determined by the GM. If you’re legendary, the maximum increases to a month.", 0 }
                });

            migrationBuilder.InsertData(
                table: "HazardTypes",
                columns: new[] { "Id", "Description", "Name", "SourcePageId" },
                values: new object[,]
                {
                    { new Guid("db68d894-7a5a-489f-a6f5-ca45ef6986f6"), "Traps are usually built or placed, though they can also form accidentally, such as if a magic portal, through millennia of disuse, malfunctions as its magic warps. Mechanical traps always have some physical component, whereas purely magical traps typically don’t. Magical traps can usually be counteracted by dispel magic, and those without a listed proficiency rank for Stealth can be found using detect magic. Thievery is the most common skill used to disable traps.", "Traps", new Guid("ffe77480-d1b7-4155-9152-4bbb4a651721") },
                    { new Guid("9d0426d4-021e-4822-a114-04840f3bb9c4"), "Haunts are spiritual hazards, usually formed when the spiritual essence of a location is imprinted with the instincts and emotions from a living being’s demise. Because haunts lack matter, they rarely involve a physical component, and when they do, that component is generally incorporeal or might even be damaged only by positive energy. The skills and options used to disable haunts vary, though using Religion for an exorcism is common. However, even with a successful check to disable a haunt, it can reoccur until its unfinished business is resolved. Typically, successfully disabling or enduring a haunt provides clues to determine what it would take to lay it to rest permanently.", "Haunts", new Guid("8419e536-0368-4dc8-ae2b-72d472a4d869") },
                    { new Guid("6b56b0d2-5b30-4ccf-b72c-532c244d9b73"), "Environmental hazards are either living things, like dangerous spores and molds, or simply features of the terrain or environment, like avalanches or rockslides. While they are always physical, some environmental hazards can’t reasonably be attacked or damaged, such as a cloud of poisonous gas or a patch of quicksand. Survival is the most common skill used to disable environmental hazards.", "Environmental Hazards", new Guid("3ab73fe4-1b68-42e0-8a0e-c7cc58cb5301") }
                });

