                    { new Guid("179d71a1-ba70-4709-bf82-5905bf06341f"), 0, new Guid("9d5aaa18-2a33-4468-b219-bf3429228901"), "Even creatures with darkvision (but not greater darkvision) can barely see through the darkness. They treat targets seen through the darkness as concealed.", 0 },
