            migrationBuilder.InsertData(
                table: "Hazards_RoutineDetails",
                columns: new[] { "Id", "Order", "OwnerId", "Text", "Type" },
                values: new object[,]
                {
                    { new Guid("85e4e3c2-a458-4da2-851e-16f694b880cc"), 0, new Guid("d609d826-9840-4418-a0a4-9a9531e09f17"), "The trap launches one dart against every creature in the gallery as 1 action. Because it launches darts continuously, the trap can also use the Continuous Barrage free action (see below) to launch darts at each creature during that creature’s turn.", 0 },
                    { new Guid("4f8f2529-93b8-4bad-8841-59f73d6e119c"), 1, new Guid("8bb8a7b1-c597-480b-8a23-5d28157c0310"), "A creature in the quicksand can attempt a DC 20 Athletics check to Swim to either raise itself by one step if it’s submerged to its neck or worse, or to move 5 feet if it’s submerged only up to its waist. On a critical failure, the creature is pulled down one step. A creature that Swims out of the quicksand escapes the hazard and is prone in a space adjacent to the quicksand patch. Other creatures can Aid the creature, typically by using a rope or similar aid, or attempt to pull the creature out with their own DC 20 Athletics check, with the same results as if the creature attempted the check.", 0 },
                    { new Guid("f5149d1e-92e7-468d-aaf7-c71f195e464a"), 0, new Guid("8bb8a7b1-c597-480b-8a23-5d28157c0310"), "On its initiative, the quicksand pulls down each creature within it. A creature that was submerged up to its waist becomes submerged up to its neck, and a creature that was submerged up to its neck is pulled under and has to hold its breath to avoid suffocation(page 478).", 0 },
                    { new Guid("bb0601b7-7b22-47fc-a985-a53eccad97a2"), 0, new Guid("e417fa19-f7e3-4372-988e-8e2ce524e804"), "The trap uses its first action to make a spinning blade Strike against each adjacent creature, its second action to move straight in a random direction (roll 1d4 to determine the direction), and its third action to make a spinning blade Strike against each adjacent creature. This trap doesn’t take a multiple attack penalty.", 0 },
                    { new Guid("2411b443-2b72-48d1-b59e-b6688b774df9"), 0, new Guid("ff781a33-7aa2-426b-adf2-672bcf0e1681"), "The trap uses its action to force one random creature that failed its save against wail of the banshee last turn to emit a wail of the banshee with the same statistics as the initial one. The creature wails even if it is dead or unable to speak, no matter how far away from the trap it is. Unlike a casting of the spell, the drained condition from this trap’s wail of the banshee spells increases the targets’ drained condition values. A creature that critically succeeds at any of its saves can still be affected by the trap on future rounds, but can’t be forced to wail by the trap.", 0 },
                    { new Guid("9aea181f-b676-4651-a636-710699c43495"), 5, new Guid("5f206ecc-b2a0-473c-9e09-561e7909787c"), "Acid Arrow", 2 },
                    { new Guid("22e59604-b410-4183-820b-2dcfff400a8c"), 4, new Guid("5f206ecc-b2a0-473c-9e09-561e7909787c"), "Blindness", 2 },
                    { new Guid("5bfc3074-35e2-4406-bcd4-152b4c8f3069"), 0, new Guid("12cbc8b1-311a-4826-bf59-784c2a790e0f"), "Each decoration uses 3 of the trap’s actions each turn, and the trap loses 3 actions each turn for every decoration that is disabled. A decoration uses its first action to move its cloud of objects up to 200 feet, its second action to make the objects Strike, and its third action to add more objects to the cloud, increasing its damage by 1d12 (to a maximum of 4d12+10). If a decoration’s cloud is already at maximum damage, it does nothing with its third action.", 0 },
                    { new Guid("c0e914be-277a-4cd2-a30a-ecdb53d8f2c6"), 3, new Guid("5f206ecc-b2a0-473c-9e09-561e7909787c"), "Lightning Bolt (100-foot line)", 2 },
                    { new Guid("35c80760-aec4-41ba-a3d3-e256796bd457"), 2, new Guid("5f206ecc-b2a0-473c-9e09-561e7909787c"), "Paralyze", 2 },
                    { new Guid("9e4955f6-7270-4de7-ad78-8f728b8a4e57"), 1, new Guid("5f206ecc-b2a0-473c-9e09-561e7909787c"), "Sleep", 2 },
                    { new Guid("087a9701-90ab-4e85-a64d-8bca7032c349"), 0, new Guid("e3110eda-b8bf-4599-bfe6-d95ebaf43948"), "The mirror absorbs another reflected creature into the mirror and replaces it with a mirror duplicate. Mirror duplicates attack on their own initiative, using the same statistics as the original creature, but with an evil alignment (changing only abilities that shift with the alignment change). A mirror duplicate can spend 3 actions in contact with the mirror to return to its original dimension and release the creature it duplicated, but most mirror duplicates prefer not to.", 0 },
                    { new Guid("58d97828-a01d-4101-b04e-d5e3b804b7a8"), 1, new Guid("3a554a92-f873-4560-9a1a-ad10916b7f1a"), "A creature that starts its turn in lava takes 8d6 fire damage and is immobilized until it Escapes the hardening lava (DC 27). The creature might suffocate if covered in lava (page 478). Lava from the previous round hardens fully at the start of the trap’s turn, effectively raising the floor of the room. Once the room is full of lava, the trap stops taking actions, but creatures in the room remain stuck until the floor opens and the trap resets.", 0 },
                    { new Guid("417e2e47-e956-49d4-b01e-82da90ed3027"), 0, new Guid("5f206ecc-b2a0-473c-9e09-561e7909787c"), "On its initiative, the trap uses its first action to spin, then stops. Roll 1d6 to determine which segment is topmost when the wheel stops spinning. The wheel uses its second action to replicate the spell listed for that segment (3rd level, DC 24, spell attack roll +14). This spell’s target is centered on or otherwise includes the nearest creature in the area. This increases the spell’s range to 100 feet if necessary. Any spell cast by this trap is arcane.", 0 },
                    { new Guid("dbc0d3e9-fac4-47d3-8942-09f87c55df5d"), 0, new Guid("3a554a92-f873-4560-9a1a-ad10916b7f1a"), "The trap loses 1 action per disabled channel each turn. On each action, a different channel spews lava, dealing 4d6 fire damage to each creature within 10 feet of the channel (DC 27 basic Reflex save), and increasing the depth of the lava in the room by 1 foot (4 feet per round if all the channels are active).", 0 },
                    { new Guid("d58fd9ed-f604-45d1-ab07-65c3cc68799c"), 0, new Guid("06b3ee8e-446d-49e5-8737-551f94484753"), "The trap loses 1 action each turn for each disabled water spout. On each of the trap’s actions, a spout pours water, increasing the depth of the water by 5 feet. Once the pit is full of water, the pit stops using actions, but creatures in the pit begin drowning (page 478).", 0 },
                    { new Guid("2fdfb966-1fa4-4286-9409-8c415686c09e"), 6, new Guid("5f206ecc-b2a0-473c-9e09-561e7909787c"), "Ray of Enfeeblement", 2 },
                    { new Guid("3564caf0-6c49-4cff-9e37-0cfdc2f57bf2"), 1, new Guid("12cbc8b1-311a-4826-bf59-784c2a790e0f"), "If a decoration’s cloud has been destroyed, the decoration instead spends its first action to create a new cloud of objects inside the room (using the starting damage value) and then its second and third actions to have the cloud move and Strike.", 0 }
                });

